		"地名的来历": "    1958年根据中共佳木斯市委农工部意见，设立佳木斯市郊区妇女联合会。",
		"地名的含义": "    因负责郊区妇女儿童的各项权益保障、教育宣传等日常工作而得名。",
		"地名的历史沿革": "    1958年3月12日，根据中共佳木斯市委农工部，关于撤销市委农工部、人委农林科，设立郊区委及郊区人民委员会的具体意见，区委设区妇联，称郊区妇女联合会，2004年永红区妇联并入郊区妇联，名称沿用至今。  ",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市郊区妇女联合会地址为友谊路8号，郊区政府办公楼内，东临农业银行西临支行，南临友谊路，西临佳木斯市交通运输管理站，北临广源物流管理中心。区妇联内设4个部门：组宣部、发展部、儿童部、维权部。设机关行政编制4名。主席、副主席各1职。联系电话为0454-8560954，邮政编码为154002。主要职责：指导全区各级妇联依据《中华全国妇女联合会章程》和妇女代表大会的决议，开展妇女儿童工作。调查研究全区妇女和儿童事业发展情况，及时向区委和区政府反映妇女儿童工作的重大问题，提出建议。指导和推动全区农村妇女的“双学双比”（学文化、学技术、比成绩、比贡献）活动和城市妇女下岗再就业工作。指导全区各级妇联的宣传工作；教育、引导广大妇自尊、自信、自立、自强，总结、表彰全市各行各业先进妇女。代表全区妇女参与国家和社会事务的民主智理、民主监督；参与研究、制定有关维护妇女儿童权益方面的法律、法规、规章的制度，维护妇女儿童合法权益。为妇女儿童服务，加强与社会各界的联系，协调和推动社会各界为全巿妇女儿童办实事、办好事。建立与全区各族各界妇女的联系，巩固妇女的大团结；发展全区同世界各国妇女的友好交往，增进了解和友谊。承担区委、区政府妇女儿童工作委员会日常工作。承办区委、区政府交办的其他事项。",
