		"地理实体概况": "    中共佳木斯市郊区委员会统一战线工作部地址为友谊路8号，郊区行政中心楼内。东临农业银行西临支行，南临友谊路，西临佳木斯市交通运输管理站，北临广源物流管理中心。为区委的工作部门，内设台湾工作办公室，配备机关行政编制2名，设部长、副部长各1职。联系电话为0454-8560895，邮政编码为154004。其主要职责是：调查研究统一战线的理论和重大的方针政策，组织贯彻执行中央和省、市委关于统一战线的方针、政策；向市委统战部及区委反映情况，提出开展统战工作的意见和建议；负责联系各民主党派和无党派代表人士，及时通报情况，反映他们的意见和建议；研究贯彻党领导的多党派合作和政治协商制度及民主党派的方针、政策；落实中央和省、市委关于发挥民主党派参政议政和民主监督作用的工作；支持、帮助各民主党派加强自身建设，选拔、培养新一代代表人物；负责调查研究、协调检查有关民族、宗教工作的重大方针、政策问题；联系少数民族和宗教界的代表人物；协助有关部门做好少数民族干部的培养举荐工作；贯彻执行党的对台政策，开展以祖国统一为重点的海外统战工作；负责党外人士的政治安排，会同有关部门做好培养、选拔、推荐党外人士担任处级行政领导职务工作，做好党外后备干部和新的代表人物队伍建设工作；调查研究并反映全区非公有制经济代表人物的情况，协调关系，提出政策建议；调查研究党外知识分子的情况，反映意见，协调关系，提出政策建议；联系并培养党外知识分子的代表人物；负责开展海外统一战线的宣传工作；、负责指导全区基层党委总支的统战工作和统战干部的培训工作，协调区政府有关部门的统战工作；联系区指导工商联工作；承办区委交办的其他工作。 ",
