		"地名的历史沿革": "    敖其逐渐形成村落后，一直为依兰所管辖，至1910年（清宣德二年），桦川设置，属桦川县安业区。1946年，桦川县在敖其成立永安区人民政府。1951年改称桦川县第八区人民政府。1956年划区建乡为桦川县永安乡人民政府。1958年人民公社化时期，原永安，裕太，大来，兴华4乡合并成立跃进人民公社，区划调整从桦川县划出归佳木是市郊区人民委员会管辖。1962年永安人民公社更名为敖其人民公社。1984年撤社建乡，敖其人民公社更名为敖其乡人民政府。1985年改为敖其镇人民政府，沿用至今。",
