		"地理实体概况": "    佳木斯市郊区人民代表大会常务委员会机关地址为友谊路8号，郊区行政中心办公楼内。东临农业银行西临支行，南临友谊路，西临佳木斯市交通运输管理站，北临广源物流管理中心。佳木斯市郊区人民代表大会是根据《宪法》、《选举法》、《地方组织法》经普选产生的地方国家权力机关。与郊区人民政府、郊区人民法院、郊区人民检察院之间是决定与执行，监督与被监督的主从关系。区人大内设机构有办公室、认识联络办、经济办、法制办、教科文卫办、信访办等科室。有代表176人、常委18人，设主任1职、副主任4职。有机关工作人员19人。联系电话为0454-8582047，邮政编码为154004。主要职责是：在本行政区域内，保证宪法、法律、行政法规和上级人民代表大会及其常务委员会决议的遵守和执行；领导或者主持本级人民代表大会代表的选举；召集本级人民代表大会会议;讨论、决定本行政区域内的政治、经济、教育、科学、文化卫生、民政、民族工作的重大事项；根据本级人民政府建议，决定对本级行政区域内的国民经济和社会发展计划、预算的部分变更；监督本级人民政府、人民法院和人民检察院的工作。联系本级人民代表大会代表，受理人民群众对上述机关和国家工作人员的申诉和意见；撤销下级人民代表大会及其常务委员会的不适当的决议；撤销本级人民政府的不适当的决议和命令；在本级人民代表大会闭会期间，决定副区长的个别任免。在区长和人民法院院长、人们检察院检察长因故不能担任职务的时候，从本级人民政府、人民法院、人民检察院副职领导人员中决定代理的人选；根据区长的提名，决定本级人民政府局长、主任、科长的任免，报上一级人民政府备案；按照人民法院组织法和人民检查院组织法的规定，任免任免法院副院长、庭长、副庭长、审判委员会委员。任免人民检察院副检察长，检察委员会委员、检查员，批准佳任免下一级人民检察院检察长；在本级人民代表大会闭会期间，决定撤销个别副区长的职务，决定撤销由它任命的本级人民政府其他组成人员和人民法院副院长、庭长、副庭长、审判委员会委员、审判员、人民检察院副检察长，检察委员会委员、检查员的职务；在本级人民代表大会闭会期间补选上一级人民代表大会出缺德代表和撤换个别代表；决定授予地方的荣誉称号。。 ",
