		"地理实体概况": "    佳木斯市郊区民政局地址为友谊路275号，郊区政府二办办公楼内。东、南、西紧邻居民住宅楼，北临友谊路。为郊区政府管理有关社会行政事务的职能部门。局内设双拥办公室，基层政权与社区建设办公室，救灾救济办公室，婚姻登记办公室，社会行政事务管理办公室，行政办公是等6个科室。局机关有行政编制16名，工勤编制1名，设局长1职，副局长2职。联系电话为0454-6045309，邮政编码为154002。主要职责是：按照国家、省、市民政事业发展的总体要求，根据全区国民经济与社会发展规划，研究制定全区民政事业发展战略，编制全区民政事业中、长期发展规划，制定年度工作计划。研究制定民政工作政策、法规政治实施和监督检查；负责全区农村救灾工作。核实上报灾情，分配救灾款物；组织全区救灾捐赠活动和救灾捐款赠物的接收、分配；检查监督救灾款物使用情况；指导灾区开展生产自救合作保险工作；管理全区城乡社会救济工作。负责农村五保户供养和城乡社会困难户，定期救济临时救济工作；负责六十年代精简退职老职工和特殊救济对象的救济工作；负责农村扶贫扶优工作；指导救灾扶贫经济实体工作；负责全区拥军优属工作，负责优抚对象的优待、抚恤、补助、革命烈士的审核呈报、褒扬工作；负责革命伤残人员伤残等级审核、呈报工作；负责区军人退伍义务兵的接收安置工作；负责区退伍军人两用人才的开发使用工作；负责全区农村社会养老保险工作；组织建立和完善农村社会养老保险制度，指导、监督农村社会养老保险的基金和使用；负责组织实施区社会福利发展规划；发展乡镇康复中心的工作，指导社会服务工作。指导老年人的权益保护工作，推动社会化服务体系的建立于发展；负责和指导全区社会福利生产，会同有关部门制定并监督实施残疾人就业和社会福利生产的扶持保护政策；负责全区民政福利企业发展基金和生产周转金的筹集、使用与管理；负责全区基层政权建设，指导基层群众组织建设；推动城乡村民和居民自治活动；负责拟定全区行政区域规划；负责乡镇的设立、扩撤、更名和界线变更的审核报批；负责全区行政区域边界勘界；承办区际边界争议的调处，提出仲裁建议；负责地名命名、更名和地名档案管理工作；指导全区地名标志，设置乡镇门牌管理工作；负责全区性社团和在内组织的跨区社团的审批登记和管理工作；负责社团工作法律咨询和社会服务工作；负责全区婚姻登记和婚姻管理，改革婚姻陋习，开展婚姻服务工作，指导妇女儿童在婚姻中的权益保护工作；负责全区殡葬管理，推行殡葬改革；负责流浪乞讨人员的遣送工作；负责社会福利有奖募捐工作；负责民政事业计划财务工作、指导、监督民政事业费得使用和管理；工作乡镇民政事业费得审计工作；负责民政系统表彰奖励工作；负责接待民政方面的人民群众的来信来访，指导全区民政系统的信访工作；承办区政府交办的其他工作。 ",
