		"地理实体概况": "    佳木斯市郊区监察局地址为友谊路8号，郊区政府办公楼内。东临农业银行西临支行，南临友谊路，西临佳木斯市交通运输管理站，北临广源物流管理中心。与区纪律检查委员会合署办公。人员编制10人，设局长1职，副局长2职。联系电话为0454-8582085，邮政编码为154004。是区政府职能部门，履行党的纪律检查和政府行政监察两种职能，对区委全面负责，区监察局仍属区政府序列，接受区政府和市监察局领导。主要职责是：主管党的纪律检查工作，负责贯彻落实党中央、中央纪委和省、市、区关于加强党风廉政建设的决定，维护党的章程和其他党内法规，检查党的路线、方针、政策和决议的执行情况；主管全区行政监察工作，负责贯彻落实党中央、国务院、监察部和省、市、区有关行政监察工作的决定，监督检查区政府各部门及其工作人员和各乡镇及其主要负责人执行国家政策和法律法规，国民经济和社会发展计划及区政府颁发的决议和命令情况；负责检查并处理区委、区政府机关各部门和各乡镇党组织和区委管理的党员领导干部违法党的章程及其他党内法规的案件，决定或取消对这些案件中的党员的处分；受理党员的控告申诉，必要时直接查处下级党的纪律检查机关管辖范围内的比较重要或复杂的案件；负责调查处理区政府各部门及其工作人员和乡镇及其主要负责人违反国家政策，法律法规以及违反政纪的行为，并根据责任人所犯错误的情节轻重，做出撤职及撤职以下的行政处分（对涉及选举产生的领导干部按法定程序办理）；受理监察对象违反纪律行为的检举、控告；负责做出关于维护党纪的决定，制定全区党员党纪教育规划，配合有关部门做好党的纪检工作，行政监察工作的方针、政策的宣传和对党员国家工作人员遵纪守法，为政清廉的教育工作；调查研究区政府各部门和各级政府制定有关政策法规情况，对其违反国家法律和有损国家利益的条款，提出修改补充建议；变更或撤销各级行政监察机关不适当的决定和规定；根据我区党风廉政建设实际，拟定党纪条规和政策规定；会同区委区政府各部门及各乡镇党委和政府做好纪检，监察干部的管理工作；审核各乡镇、区直有关部门纪委领导班子人选；组织和指导全区纪检、监察干部的培训工作；完成区政府交办的其他工作。",
