		"地理实体概况": "    佳木斯市郊区残疾人联合会地址为佳木斯市友谊路275号，郊区第二行政中心南楼内。东、南、西紧邻居民住宅楼，北临友谊路。隶属于区政府，编制4人，设理事长1人。联系电话为0454-6045102，邮政编码为154002。主要职责是：受区人民政府委托，负责按比例安排残疾人就业的行政管理和行政执法工作；密切联系残疾人，听取残疾人意见，反映残疾人需求，全心全意为残疾人服务；团结、教育残疾人，遵守法律，履行应尽义务，发扬乐观进取精神，自尊、自信、自强、自立，为现代化建设贡献力；沟通政府、社会与残疾人之间的联系，宣传残疾人事业，动员社会理解、尊重、关心、帮助残疾人；开展和促进残疾人康复、教育、劳动就业、文化生活、福利、社会服务和残疾预防工作，改善残疾人参与社会生活的环境和条件；协助政府研究、制定和实施残疾人事业的法规、政策、规划和计划，发挥综合、协调、咨询、服务作用，对有关领域的工作进行管理和指导；承担政府残疾人工作协调委员会的日常工作；管理和发放《中华人民共和国残疾人证》；联系、指导各残疾人群众组织，培养残疾人工作者。",
