		"地名的来历": "    2012年佳木斯市郊区政府将郊区农业委员会改称佳木斯市郊区农业局。",
		"地名的含义": "    因其位于郊区境内，主管农业和农村经济，重点负责郊区的农业、种植业工作而得名。",
		"地名的历史沿革": "    1946年市政府建设科兼管农业。1952年6月设农林科。1958年成立市蔬菜产销委员会。1959年改称农业科。1961年升格为农业局。1967年文化大革命期间改称郊区农业事业革命委员会，1972年改称郊区蔬菜组，同年又更名为郊区农业科。1976年更名郊区农业局（副处级）。1984年更名郊区农牧渔业局，1985年恢复郊区农业局。2002年改称郊区农业委员会。2012年更名为郊区农业局，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
