		"地理实体概况": "    佳木斯市郊区农业局地址为友谊路275号，政府二办楼内。东、南、西紧邻居民住宅楼，北临友谊路。机关内设办公室、综合股、政工股、政策法规股、财审股等。核定人员编制20名，设局长1职、副局长3职。联系电话为0454-5617533，邮政编码为154002。郊区农业局是区政府主管农业和农村经济，重点负责种植业工作的职能部门，其主要职责是：贯彻国家有关农业和农村经济发展的方针、政策、法律和规章，并监督检查执行情况；研究制定全区农业种植业发展中长期规划和年度计划，并组织实施。负责农业种植业区划，负责对农业重点建设项目，农产品生产基地建设项目以及名优特新农产品开发项目的立项、论证、审核、申报工作，编制中低产田改造方案，并组织实施；会同有关部门组织制定主要产品技术标准；根据授权负责农作物种子、苗木、农产品及肥料、农药等有关农用生产资料质量监测、鉴定和监督管理；负责开发无污染农副产品；按分工管理农业资源，指导农业资源的开发和综合利用；指导全区农业环境保护监测，防止污染；监督检查保护农业生态环境；指导农作物植物检疫及农作物病虫害防治；制定农业科技推广，发展规划；组织农业推广部门进行技术把关，技术改造及科研成果的鉴定，普及推广；指导并协调农业社会化服务体系建设，为农民提供产前、产中、产后系列化服务；编制农业和农民教育发展规划，并组织实施；指导农村干部和农民中、长短期农业技术培训和农业广播电视学校工作；负责组织农民适用技术培训和绿色证书教育；负责农业技术干部，农村技术职称的评聘工作；负责农业宣传工作；指导农村经济组织建设与发展；指导农村联产承包责任制和双层经济体制的稳定与完善；指导农村合同管理；协同有关部门指导农村经济体质改革；协同农村各种经营利益关系等。指导农业种植业生产；指导农业种植业生产，会同有关部门搞好农产品加工、销售、储存；参与研究制定全区“菜篮子工程“的规划和协调”菜篮子工程“的实施工作；负责全区种植业农业工作；协同有关部门提供农业经济技术信息，为农民提供服务，促进市场经济发展；负责制定园艺、经济作物、养蚕等项产业发展规划；组织指导全市各种经营生产；负责系统内的人事、劳资各种；完成区政府交办的其他工作。",
