		"地理实体概况": "    佳木斯市安全生产监督管理局地址为长安西路816号市行政中心3号楼，巿安全监督局内设4个职能科（室）。行政编制13名，工勤人员事业编制2名，离退休干部工作人员编制2名，局长1名，副局长2名，助理调研员1名（副处级），科长4名。联系电话为0454-8225866，邮政编码为154004。主要职责是：指导、协调、监督全市安全生产工作；组织起草全市安全生产规范性文件；拟订安全生产规划；分析和预测全市安全生产形势，发布全市安全生产信息，协调解决安全生产中的重大问题。承担生产经营单位安全生产监督管理责任；按照分级属地原则，依法监督检查生产经营单位贯彻执行安全生产法律法规情况及安全生产条件和有关设备（特种设备除外）材料、劳动防护用品和安全生产管理工作；指导协调、监督检查各县(市）区政府、市直有关部门及中省直驻佳单位安全生产工作。监督考核并通报安全生产控制指标执行情况，监督事故查处和责任追究落实情况。承担非煤矿矿山和危险化学品、烟花爆竹生产经营单位安全生产准入相关管理责任，依法组织并指导监督实施安全生产准入制度。负责危险化学品安全监督管理综合工作和非煤矿矿山、烟花爆竹安全生产监督管理工作。对产煤县煤矿安全生产进行指导监督和检查。承担生产经营单位作业场所职业卫生监督检查责任，按规定负责职业卫生安全许可证的管理工作，组织查处职业危害事故和违法违规行为。贯彻和组织实施工矿商贸行业安全生产规章、标准和规程，监督检查重大危险源的监控和重大事故隐患排查治理工作；依法查处不具备安全生产条件的生产经营单位。负责组织市政府安全生产大检查和专项督查；根据市政府授权，依法组织生产安全事故调查处理和办理结案工作，监督生产安全事故查处和责任追究落实情况；指导各县(市）区人民政府对一般生产安全事故的调查处理工作，协助国家安全生产监督管理局和省安全生产监督管理局调查处理重大以上事故。负责组织、协调安全生产事故应急救援工作；指导协调和监督全市安全生产行政执法工作；综合管理全市生产安全伤亡事故和安全生产行政执法统计分析和上报工作。负责监督检查职责范围内新建、改建、扩建工程项目（以下简称“建设项目”）的安全设施与主体工程同时设计、同时施工、同时投产使用（以下简称“三同时”）情况；组织职责范围内建设项目安全设施的设计审查和竣工验收。组织指导、监督特种作业人员的考核工作和生产经营单位主要负责人、安全生产管理人员的安全资格考核工作；监督检查生产经营单位安全生产和职业安全培训工作。组织、指导、协调全市安全生产检测检验工作；监督管理安全生产社会中介机构和安全评价工作；按规定对注册安全工程师的注册执业活动实施监督管理。组织拟订全市安全生产科技规划，指导协调安全生产科学技术研究和推广工作。承办市政府交办的其他事项。",
