		"地名的历史沿革": "    自1946年9月成立市总工会。1967年召开首届革命工人代表大会，选举产生市首届革命工人代表大会常设委员会，取代市总工会。1973年9月，市总工会机构恢复。2002年体制改革，根据巿委、巿政府批准的《佳木斯巿群众团体机关机构改革方案》（佳办发〔2001〕28号），佳编〔2002〕30号，设置佳木斯巿总工会（简称巿总工会），为巿委领导下的职工自愿结合的工人阶级群众团体，名称沿用至今。",
