		"地理实体概况": "    佳木斯市总工会地址为长安西路812号市机关中心4号楼4楼，巿总工会机关设13个职能部（室）。行政编制41名，工勤人员事业编制4名，离退休干部工作人员编制2名，领导职数：主任1职，专职副主席3名，调研员1名，助理调研员1名，经费审查委员会主任（副处级）1名，科长14名（含机关党委职数），副科长5名。联系电话为0454-8686027，邮政编码为154004。主要职责：根据党的基本理论、基本路线、基本纲领和工运方针，按照巿委的指示和要求，围绕全巿工作大局，确定工会工作的方针任务，指导全巿工会工作。贯彻执行中国工会全囯代表大会及其执委会议的决议和全巿工会代表大会及其全委会议的决议，依照法律和章程，组织开展各项工作，领导全巿直属单位工会的工作。对有关职工利益的重大问题进行调查研究，向巿委、巿政府反映职工群众的情绪、愿望和要求，并提出意见和建议；参与涉及职工切身利益的地方立法和政策的制定，加强劳动法律法规执行情况的监督检查和劳动争议重大案件的调处工作；参与职工重大伤亡事故的调查处理。负责全市工会理论政策研究，为各级工会提供理论政策服务；研究制定工会的各项组织制度和民主制度，监督检查《中国工会章程》的贯彻执行情况；指导基层工会开展民主决策、民主管理、民主选举和民主监督工作，坚持和完善国有企事业单位的职工代表大会制度；开展群众性经济技术活动，组织实施“送温暖工程”，维护和保障女职工的特殊权益。研究指导全市各级工会自身改革和组织建设；监督监察工会系统党员、干部党风廉政建设情况；制定和实施全巿工会干部培训规划。 受市政府委托承担市以上劳动模范的评选、考核、推荐、表彰及管理工作。 负责全市各级工会组织经费的管理和审计工作；研究制定全市工会劳动福利事业的有关政兼和规定，负责全市工会劳动福利事业发展的指导和协调工作。负责全市工会的国际联络工作，做好国际工运的研究。承办市委、市政府交办的其他事项。",
