		"地名的历史沿革": "    1948年12月在财政科设审计股。1957年市财政局内设财政监察科。1958年取消。自1983年成立佳木斯市审计局。1985年1月原合江审计局并入。2002年1月23曰根据省委、省政府批准的《佳木斯市党政机构改革方案》黑编〔2001〕80号），佳编〔2002〕24号文件设置佳木斯市审计局（简称市审计局）。市审计局为市政府工作部门，是市政府的审计机关，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市审计局地址为长安西路816号市机关中心6号楼三楼东侧，人员编制61人，设有局长1人，副局长3人，总审计师1人，副调研员1人，科长18人，科员37人。联系电话为0454-8635167，邮政编码为154004。主要职责是：贯彻落实国家及省有关审计工作的方针政策和法律法规，拟订地方性审计工作规范性文件并监督执行。参与起草财政经济及其相关的规章制度。制定并组织实施全市审计工作发展规划和专业领域审计工作规划，制定并组织实施年度审计计划。对直接审计、调查和核查的事项依法进行审计评价，作出审计决定或提出审计建议。负责对审计监督范围内的财政收支和财务收支的真实、合法和效益依法进行审计监督，维护财政经济秩序，提高财政资金使用效益，促进廉政建设，保障国民经济和社会健康发展。对审计、专项审计调查和核查社会审计机构相关审计报告的结果承担责任，并负有督促被审计单位整改的责任。向市政府和省审计厅提出年度市级预算执行和其他财政收支情况审计结果报告。受市政府委托向市人大常委会提出市级预算执行情况和其他财政收支情况的审计工作报告、审计发现问题的纠正和处理结果报告。向市政府和省审计厅报告对其他事项的审计和专项审计调查情况及结果。依法向社会公布审计结果。向市政府有关部门和下级人民政府通报审计情况和审计结果。依法审计市级财政直管县（市）区人民政府、市直各部门（含直属单位）的预算执行情况、决算和其他财政收支，市级财政转移支付资金；市政府部门、县（市）区人民政府管理和其他单位受市政府及其部门委托管理的社会保障基金、社会捐赠资金及其他有关基金、资金的财务收支；国际组织和外国政府在我市援助、贷款项目的财务收支，出具审计报告，在法定职权范围内作出审计决定或向有关主管机关提出处理处罚的建议。依法审计使用市级财政资金的事业单位和社会团体的财务收支，并出具审计报告，在法定职权范围内作出审计决定或向有关主管机关提出处理处罚的建议。依法审计市级投资和以市级投资为主的建设项目的预算执行情况和决算，并出具审计报告，在法定职权范围内作出审计决定或向有关主管机关提出处理处罚的建议。依法审计市属国有企业和金融机构、市政府规定的市级国有资本占控股地位或者主导地位的企业和金融机构的资产、负债和损益；市属驻外非经营性机构的财务收支。依法通过适当方式，组织审计市属国有企业和金融机构的境外资产、负债和损益，并出具审计报告，在法定职权范围内作出审计决定或向有关主管机关提出处理处罚的建议。依法审计县处级领导干部及依法属于市审计局审计监督对象的其他单位主要负责人的经济责任，出具审计报告，在法定职权范围内作出审计决定或向有关主管机关提出处理处罚的建议。组织实施对国家和省财经法律、法规、规章、政策和宏观调控措施执行情况、财政预算管理或国有资产管理使用等与市级财政收支有关的特定事项进行专项审计调查。依法检查审计决定执行情况，督促纠正和处理审计发现的问题，依法办事被审计单位对审计决定提请行政复议、行政诉讼事项。协助配合有关部门查处相关重大案件。依法领导和监督下级审计机关的业务，组织下级审计机关实施特定项目的专项审计或审计调查，纠正或责成纠正下级审计机关违反国家规定作出的审计决定。按照干部管理权限协管县（市）级审计机关负责人。承办市政府交办的其他事项。 ",
