		"地名的历史沿革": "    1958年根据中共黑龙江省委（1958）23号文件批示，设立佳木斯市郊区同时设立中共佳木斯市郊区委员会。1967年“文化大革命”期间，区委被红色造反者联合接管委员会夺权。党组织停止活动。1968年郊区撤销。1972年恢复郊区，成立党政一元化领导班子，称佳木斯市郊区革命委员会。党的组织称中共郊区革命委员会核心小组。1973年中共佳木斯市郊区第一次代表大会选举产生中共佳木斯市郊区委员会，名称沿用至今。",
