		"地理实体概况": "    中共佳木斯市郊区委员会地址为友谊路8号，郊区政府第二行政中心办公楼内。中共佳木斯市郊区委员会，隶属于中共佳木斯市委员会，是区域内各项事业的领导核心。中共佳木斯市郊区委员会领导机构由全区党员代表大会选举产生，按《党章》规定每届期限为五年。区委内设办公室、组织部、宣传部、统战部、政法委、直属机关工作委员会，老干部局、信访办公室、党史研究室等工作部门。领导中共佳木斯市郊区纪律检查委员会。下辖长青、沿江、敖其、大来、群胜、莲江口、长发、平安、四丰、望江、西格木几个乡（镇）党委。设立林业局、水务局、农委、建设局、教育局、公安分局、农场管理局、供销联社、财政局、交通局、佳西街道党工委、友谊街道党工委、冬梅集团15个区直党委。共设32个总支委员会，360个党支部。全区有党员7463人。联系电话为0454-8581804，邮政编码为154004。上级管理机构：佳木斯市委员会。",
