		"地名的含义": "    因其主要负责佳木斯市范围内的接待、处理人民群众来访、来信工作而得名。",
		"地名的历史沿革": "    1985年成立佳木斯市信访办公室。2002年根据省委、省政府批准的《佳木斯巿党政机构改革方案》（黑编〔2001〕80号），佳编〔2002〕40号文件，设置中共佳木斯市委员会、佳木斯巿人民政府信访办公室（简称巿信访办）。巿信访办为巿委、巿政府部门管理机构，以巿委办公室管理为主。2008年根据佳编[2008]42号文件将中共佳木斯市委、佳木斯市人民政府信访办公室更名中共佳木斯市委佳木斯市人民政府信访局，名称沿用至今。",
