		"地理实体概况": "    中共佳木斯市委佳木斯市人民政府信访局地址为长安西路818号，佳木斯市机关中心7号楼。巿信访办内设5个职能科。行政编制19名，工勤人员事业编制2名，离退休干部工作人员编制1名。主任1名，副主任3名，科长5名，副科长3名，助理调研员1名。联系电话为0454-8775521，邮政编码为154004。主要职责：负责贯彻落实党中央、国务院、省委省政府和巿委、巿政府对信访工作的指示要求;组织实施国务院《信访条例》；负责全巿信访法制建设工作。负责组织实施《黑龙江省各级党政领导信访工作责任制》对全巿信访工作进行目标管理，检查核，定期通报；对不认真贯彻信访工作责任制并造成不良影响的单位和责任领导提出追究责任建议。负责办理人民群众写给市委、市政府及市领导同志的来信；承办上级机关交办、转办的信件。负责接待处理人民群众到市委、市政府、市领导住地的来访；承办上级机关交办的来访案件。负责市长信访电话的日常受理、处理、查办工作；对巿长信访电话工作网络进行管理；对各县（市）、区和各单位行政首长信访电话工作进行业务指导。承办省长信访电话办公室交办的事项。负责向市委、巿政府领导同志及有关部门提供我市人民群众通过来信、来访、电话反映的社情民意、重要信访信息。代表巿委、巿政府征集我市人民群众对改革开放、经济发展和社会稳定等方面的意见和建议。负责承办国家信访局、省委、省政府、市委、市政府和巿领导交办的信访案件处理和直接查办；负责向县（市）、区和市直部门交办信访案件，督办检查和审理处理结果；协调处理跨地区、跨部门（行业）的信访问题；负责市委、巿政府领导同志信访值班，接待处理群众信访问题的组织实施和决定事项落实的督办工作。负责维护市委、市政府和市领导住地正常信访工作秩序。对中央、省遣回和在巿信访机关无理取闹的上访人员进行收容管理教育或遣回当地工作。负责培训全市专兼职信访干部。 承办巿委、市政府交办的其他事项。 ",
