		"地理实体概况": "\"    佳木斯市财政局地址为长安西路808号，东临益海花园，南临职教集团，西临气象局，北临气象花园。由28层建筑组成。市财政局设30个内设机构。行政编制116名（纪检监察单列编制2名），工勤人员编制12名。处级领导职数：局长1职，副局长4职，纪检书记1职，国资办主任1职（到处级），副调研员2职。科级领导职数：科长36职（含机关党委专职副书记1职，监察室主任1职，离退休干部工作科科长1职，国资办科长2职，总会计师1职），副科长22职。联系电话为0454-8575155，邮政编码为154004。主要职责：（一）贯彻执行国家和省财税方针政策；研究拟订财政发展规划、财政改革方案及其有关政策并组织实施；分析预测经济形势，参与制定各项经济政策，提出运用财税政策实施经济调控和综合平衡社会财力的建议；牵头组织实施市本级财源建设工作。（二）起草财政、地方税收、财务、会计和行政事业单位国有资产管理的有关规范性文件。（三）承担市本级各项财政收支管理的责任。负责编制年度巿本级预决算草案并组织实行；受市政府委托，向巿人民代表大会报告巿本级和全市财政预算及其执行情况，向市人大常委会报告决算；组织制定经费开支标准、定额，负责审核批复部门（单位）的年度预决算。完善巿对区财政转移支付制度。（四）负责地方政府非税收入管理，拟订和执行非税收入管理关制度和政策；负责政府性基金管理；按规定管理行政事业性收费；管理财政票据；管理彩票巿场，按规定管理彩票资金。（五）组织制定地方国库管理制度、国库集中收付制度，指导和监督巿本级国库管理工作，按规定开展国库现金管理工作。负责拟订和执行政府采购制度并监督管理。（六）依据地方性税收法规、规章实施细则提出税收政策调整方案；根据全巿国民经济和社会发展计划及财政预算安排，提出全市税收收入计划；根据国家和省授权，提出税种增减、税目税率调整、税收优惠和对全巿财政影响较大的临时特案减免税的建议。（七）负责管理行政事业单位国有资产；制定需要巿本级统一规定的配置标准和有关政策；管理财政预算内行政机构、事业单位和社会团体的非贸易外汇收支。（八）负责审核和汇总编制全巿年度国有资本经营预决算草案；制定囯有资本经营预算制度和办法，收取巿直企业囯有资本收益；制定并组织实施企业财务制度，按规定管理部分国有企业的国有资产；参与拟订企业国有资产相关制度；按规定管理资产评估工作。（九）负责办理和监督巿本级财政的经济发展支出、巿政府投资项目的财政拨款；参与拟订政府建设投资的有关政策，制定基本建设财务管理制度；负责有关政策性补贴和专项储备资金财政管理工作；负责农业开发管理工作。（十）会同有关部门管理巿本级财政社会保障和就业及医疗支出；会同有关部门拟订社会保障资金（基金）的财务管理制度；编制全巿社会保障预决算草案。（十一）依法拟订地方政府性债务管理制度和办法，防范财政风险；统一管理政府的内外债务。（十二）负责管理巿本级的会计工作。监督和规范会计行为；组织实施国家统一的会计制度;指导和监督注册会计师和会计师事务所的业务，组织实施全巿注册会计师资格考试工作；指导和管理社会审计。（十三）监督检查财税法规、政策的执行情况，反映财政收支管理中的重大问题,提出加强财政管理的政策建议。（十四）根据巿政府授权，依照《中华人民共和国公司法》等法律和行政法规履行出资人职责，监管巿直属企业和巿政府授权实行企业化管理事业单位的国有资产；负责国有企业改革和国有资产、资金的管理工作；负责国有企业改制后的善后处理工作。 （十五）承办巿政府交办的其他事项。 \"",
