		"地名的历史沿革": "    1946年市政府设立公产管理局。1948年先后称房产公司和房产科。1956年改设房地产管理处。1960年房地产管理处改设为房地产管理局。1968年房地局接管委员会成立。1970市房地局与市城建局、市建材局合并成立合江地区建设局革命委员会。1972年从合江建设局革命委员会中分出，成立城市建设房产局。1973年城市建设房产局分开，房地产管理局恢复原建制。1996年机构改革，更名为佳木斯市房产管理局。2001年机构改革，更名为房产物业管理办公室。2002年按照《佳木斯市党政机构改革方案》（黑编[1995]118号文件），佳编（2002）73号文件将房地局更名为佳木斯市房产局。2010年更名佳木斯市住房保障局，名称沿用至今。",
