		"地名的来历": "    1945年由中国共产党领导的三江人民自治军进驻佳木斯，对民警总团进行改造，成立佳木斯市公安局。",
		"地名的含义": "    因其位于佳木斯市，主要负责贯彻执行党和国家、省有关公安工作的方针、政策、法规、规章；拟订全市有关公安工作的规章草案；负责全市公安工作，是全巿公安工作的领导和指挥机关等项工作而得名。",
		"地名的历史沿革": "    1945年11月成立佳木斯市公安局。1946年称公安总局。1966年文化大革命。机构处于瘫痪状态。1968年4月8日，撤销。1973年恢复市公安局。1985年合江地区公安局与市公安局合并称佳木斯市公安局。2004年机构改革，据省委、省政府批准的《佳木斯市党政机构改軍方案黑编〔2001〕80号），佳编[2002]70号文件，佳编[2004]15号文件整合，定名为佳木斯市公安局（简称巿公安局）。市公安局为主管全巿公安工作的市政府工作部门。2010年12月27日机构改革，根据佳编[2010]94号文件整合。2013年10月由保卫路100号搬迁至此，名称沿用至今。",
