		"地理实体概况": "    佳木斯市公安局地址为长安西路888号，巿公安局政法专项编制507名（含纪检单列编制5名）。处级领导职数：局长1职，副局长4职，副书记1职，纪检书记1职，政治部主任1职，工会主席1职，副调研员2职。内设机构领导职数：正职43职，副职54职。联系电话为0454-8298076，邮政编码为154004。主要职责为：（一）贯彻执行党和国家、省有关公安工作的方针、政策、法规、规章；拟订全市有关公安工作的规章草案；负责全市公安工作，是全巿公安工作的领导和指挥机关。（二）负责全市公安队伍建设规划；制定全市公安系统的教育训练和宣传的方针、计划；按规定权限管理干部。（三）制定全巿公安队伍监督管理工作制度并组织实施；组织开展警务督察工作，查处或督办公安队伍违纪案件。（四）掌握、研究、分析全巿公安情报信息，为巿委、巿政府和上级公安机关提供社会治安方面的重要信息，并提出对策。（五）负责全巿公安机关的装备建设和警务保障等工作。（六）负责研究、分析全巿公安信访情况；承担本级公安机关管辖的信访事项及对下指导工作。（七）维护国内安全和社会政治稳定；负责对邪教及有害气功组织的防范和处理。（八）维护社会治安秩序；依法管理户籍、居民身份证、枪支弹药、危险物品和特种行业；管理集会、游行、示威活动；指导和监督全巿国家机关、社会团体、企事业单位治安保卫及群众性洽安组织的治安防范工作。（九）指导、管理全市巡控体系的业务建设工作；负责全巿公机关防范、打击恐怖活动工作。（十）组织指导全巿公安侦察工作，协调处理重大案件、严重害社会治安的重大治安事故和骚乱。（十一）负责全市公共安全产品的管理工作。规划指导全，公安科学技术、刑事技术和行动技术建设；负责全市公共信息网络;的安全监察工作；负责公安信息化工作。 （十二）承办和指导全市收容教养审批工作。 （十三）负责全巿公安机关依法承担的执行刑罚和监督、考察工作及全巿公安机关所属看守所、拘留所、强制隔离戒毒所等的管理建设工作。（十四）依法管理国籍，组织指导出、入境和外囯人在中国境内居留、旅行的有关管理工作。（十五）依法管理全巿道路交通安全，维护交通秩序，处理交通事故。（十六）组织、监督全市消防工作；管理全市边防检查及边防治安工作。（十七）负责来我巿的国家规定特定人员的警卫工作和重要的场所、设施的警卫工作。 （十八）承办市委、市政府和上级公安机关交办的其他事项。",
