		"地理实体概况": "    中国民主同盟佳木斯市委员会地址为长安西路812号，行政中心4号楼4楼西侧。核定人员编制11人，设委员长一职。联系电话为0454-8511157，邮政编码为154004。主要职责是：第一条 中国民主同盟是主要从事文化教育以及科学技术工作的高、中级知识分子组成的，具有政治联盟特点的，致力于建设中国特色社会主义事业的参政党。第二条 中国民主同盟一切活动以中华人民共和国宪法为根本准则，在宪法赋予的权利和义务范围内，按照政治自由、组织独立、法律地位平等的原则开展工作。第三条 中国民主同盟维护中国共产党的执政地位，坚持和完善中国共产党领导的多党合作和政治协商制度，贯彻执行“长期共存、互相监督、肝胆相照、荣辱与共”的方针。参加国家大政方针和国家领导人选的协商，参与国家事务的管理，参与国家方针、政策、法律、法规的制定执行。在国家政治生活中积极发挥参政议政、民主监督作用。第四条 中国民主同盟高举邓小平理论伟大旗帜，认真学习实践“三个代表”重要思想，切实履行参政党职能。第五条 中国民主同盟高举爱国主义、社会主义旗帜，坚定不移地贯彻社会主义初级阶段“以经济建设为中心，坚持四项基本原则，坚持改革开放”的基本路线，促进大团结大联合。全盟要为推进现代化建设、完成祖国统一、维护世界和平和促进共同发展三大历史任务而奋斗。与时俱进，在新世纪新阶段，要为全面建设小康社会，加快推进社会主义现代化，努力作出新贡献。第六条 中国民主同盟贯彻科教兴国战略、可持续发展战略和依法治国方略。在建设社会主义物质文明、政治文明和精神文明的实践中，为发展教育和各项文化事业，提高全民族素质而努力；为促进经济和社会协调发展，推进依法治国而努力；坚持科学技术是第一生产力，为提高我国的科学技术水平而努力；坚持“百花齐放、百家争鸣”的方针，为繁荣文化事业、促进学术民主而努力；为推进决策科学化、民主化，增强综合国力和实现各族人民共同富裕而努力。第七条 中国民主同盟反对任何分裂祖国的企图和行为。努力发展海峡两岸关系，促进祖国完全统一。加强与台湾同胞、港澳同胞和海外侨胞的交往与合作。第八条 中国民主同盟积极推进国际交往，维护世界和平、促进共同发展。第九条 中国民主同盟的组织原则是民主集中制。贯彻群众路线，充分发扬民主，实行集体领导和个人分工负责相结合的制度。第十条 中国民主同盟发扬自我教育的优良传统，加强思想道德建设，推动盟员学习邓小平理论，学习“三个代表”重要思想，倡导爱国主义、集体主义、社会主义思想，发扬民主、科学精神，解放思想，实事求是，坚持理论与实践相结合。第十一条 中国民主同盟坚持“尊重劳动、尊重知识、尊重人才、尊重创造”的重大方针，充分发挥盟员在改革开放和现代化建设中的作用；多做协调关系、化解矛盾、理顺情绪的工作，反映民盟盟员和民盟所联系的知识分子的意见和要求，维护其合法权益。第十二条 中国民主同盟自身建设的目标是：把民盟建设成为与中国共产党亲密合作、努力提高参政议政水平、不断加强自身建设、致力于建设中国特色社会主义事业的参政党。自身建设的原则是：坚持中国共产党的领导与充分发扬社会主义民主的原则；体现政治联盟的特点；体现进步性与广泛性的统一。 ",
