		"地名的历史沿革": "    1949年建立中国粮食公司佳木斯市公司。1954年改称粮食局。2002年体制改革根据省委、省政府批准的《佳木斯巿党政机构改革方案》（黑编〔2001〕80号），佳编〔2002〕43号文件，设置佳木斯巿粮食局（简称市粮食局），名称沿用至今。",
