		"地理实体概况": "    佳木斯市粮食局地址为长安路812号市机关中心2号楼一楼。市粮食局设10个职能科（室）。行政编制41人，工勤人员事业编制4人，离退休工作人员编制4人。局长兼党委书记1名，党委副书记1名，副局长3名，纪检书记1名，工会主席1名，调研员1名，助理调研员1名；科长12名，副科长6名。联系电话为0454-8222398，邮政编码为154004。主要职责：（一）贯彻执行国家、省有关粮食工作的方针、政策和行业管理法规，制定全巿粮食行业发展规划。（二）负责全巿粮食宏观调控，编制全市粮食总量平衡和粮食流通中长期规划、年度计划，参与提出进出口计划。（三）综合、分析、预测全巿粮产销形势、动态，提出我巿年度粮食总量平衡计划；调查研究粮食生产、流通中的问题，提出解决的办法和措施。（四）组织和指导囯家定购粮、储备粮和保护价粮的收购，落实国家敞开收购农民余粮政策，协调农村粮政工作。（五）负责定购粮、保护价粮、救灾粮和军队用粮的管理和供应；监督检查全市储备粮的库存、质量和安全。（六）负责落实巿内粮食产销区间的平衡、调剂，市际间粮食调运及潮粮疏散。（七）领导全巿植食系统财务管理和审计监督工作；监督检查直属单位国有资产的保增值。（八）贯彻国家粮、油、盐价格政策和质量标准，会同有关部门管理粮、油、盐商品质量检测和市场粮价监控，保障粮食有序流通；指导国有粮食购销企业的顺价销售。（九）研究制定全市粮食收购、储存、加工的网点布局规划；提出全市粮食仓储设施建设计，并职责落实。（十）指导全市植食系统重大科技开发、技术到进和科技成果的推广应用，指导全行业的经济合作和技术交流，协调全市粮油加工工作。（十一）拟定全市根食统通体，改革方案，并职责设施；负责全市粮食行业管理，推进企业改革，规范企业的经营活动，为粮食企业的发展提供服务；指导国有粮食企业扭亏解围、减员增效和设施再就业工程。（十二）指导全市粮食系统职工教育、技能培训以及行业思想政治工作和精神文明建设。〔十三）承办市政府交办的其他事。",
