		"地名的来历": "    佳木斯市政府于1978年组建并命名为黑龙江省佳木斯市人民检察院。",
		"地名的含义": "    因其位于佳木斯市，且主要是负责领导各县（市）、区人民检察院依法履行法律监督职能，保证国家法律的统一和正确实施等各项工作而得名。",
		"地名的历史沿革": "    1950年10月成立佳木斯市人民检查所。1952年同公安局合署办公。1955年设立佳木斯市人民检察院。文化大革命，检察院工作瘫痪。1978年，检察院重新组建。1985年与黑龙江省人民检察院合江分院合并。根据黑龙江省委办公厅《关于市（地）县（市、市辖区），民检察院机构改革的意见》（黑办发[1997]15号）和黑龙江省人民检察院《全省巿地、县（市）区检察院机构改革实施意见》（黑检发[1998]2号）的精神，佳编[1988]25号文件整合其职能。佳编[2003]59号文件进行机构改革。2009年12月从前进区中山路中段搬迁至郊区友谊路177号，其名称未做改动，沿用至今。",
