		"地理实体概况": "    佳木斯市人民检察院地址为友谊路177号，东临佳木斯市消防支队，南临西浦植物园，西临西浦植物园，北临友谊路。占地面积18000平方米，建筑面积13000平方米，是政府的法律监督和全巿各县（巿）、区人民检察院的领导机关机关。市人民检察院内设13各职能机构和政治处。人员编制158人，设检察长一职，副检察长4职。联系电话为0454-8620011，邮政编码为154004。主要职责是：（一）向巿人民代表大会及其常务委员会和省人民检察院负责并报告工作，接受巿人民代表大会及其常务委员会的监督，接受省人民检察院的领导。（二）依法向巿人民條表大会和巿人民代表大会常务委员会提出议案。（三）根据最高人民检察院和省人民检察院的统一部署及确定的检察工作方针、任务，领导全巿各县（巿）、区人民检察院工作。（四）依法对贪污、贿赂等经济犯罪，国家工作人员的渎职犯罪，国家机关工作人员利用职权实施的非法拘禁、刑讯逼供、报复陷害、非法搜查等侵犯公民人身权利的犯罪以及侵犯公民民主权利的犯罪案件迸行侦查；负责对省哓决定由人民检察院直接受理的国家机关工作人员利用职权实施其他重大犯罪案件的立案侦查；领导各县（市）、区人民检察院的侦查工作。（五）对重大刑事犯罪案件依法审查批捕、提起公诉；领导各县（巿）、区人民检察院对刑事犯罪案件的审查起诉和出庭公诉工作，参与社会治安综合治理。（六）领导各县（巿）、区人民检察院开展民事、经济审判和行政诉讼活动的法律监督工作。（七）对各县（巿）、区人民法院已经发生法律效力、确有错误的判决和裁定，依法向人民法院提起抗诉，对巿人民法院巳发生法律效力确有错误的判决和裁定，依法提请省检察院提出抗诉。（八）对各县（巿）、区人民检察院在行使检察权中作出的决定进行审查，纠正错误决定。（九）受理公民的控告、申诉和检举，办理刑事赔偿事项。（十）受理对贪污贿赂等犯罪的举报，并领导各县（市）、区检察机关的举报工作。（十一）规划和指导全巿检察机关的物证检验、鉴定、审核工作。（十二）对于检察工作中具体应用法律的问题进行研究，制定全帀有关检察工作的规定、办法和实施细则。（十三）指导全市检察机关的思想政治工作和队伍建设。领导各县（市）、区人民检察院依法管理检察人员。（十四）协同地方党委管理各县（市）、区院的检察长、副检察长。提请市人民代表大会常务委员会批准或不批准各县（市）、区检察院检察长的任免；提请市人大常委会决定任免市人民检察院副检察长、检察委员会委员、检察员。（十五）协同主管部门管理全市人民检察院的组织人事和机构编制工作。（十六）领导全市检察机关司法警察工作。（十七）组织领导全市检察干部的教育培训工作。（十八）指导全市检察机关的计划财务、装备工作。（十九）指导全市检察机关对外交流，开展有关国际司法协助及境外的个案协查工作。（二十）管理市院机关工作人员和所属事业单位的领导班子。（二十一）负责其他应由市人民检察院承办的事项。 ",
