		"地名的含义": "    因其位于佳木斯市境内，且主要负责全巿土地、矿产资源等自然资源的规划、管理、保护与合理利用的市政府等各项工作而得名。",
		"地名的历史沿革": "    1946年设民政科地政股。1956年城市土地归属房地局，郊区土地先后由农业局、土地局管理。1973年称市土地办。1986年根据省政府黑政发〔1986〕14号文件精神，佳编字[1986]144号文件将市土地办公室，改为佳木斯市土地管理局。2002年根据省委、省政府批准的《佳木斯市党政机革方案》（黑编〔2001〕80号文件），佳编〔2002〕73号文件将佳木斯市土地管理局、佳木斯市地质矿产局合并更名为佳木斯巿资源局（简称市国土资源局）根据佳编〔2010〕69号文件，于2010年12月27日整合，名称沿用至今。",
