		"地理实体概况": "    佳木斯市国土资源局地址为长安西路818号，市行政中心3号楼8楼。巿国土资源局（巿国土资源执法监察局）机关行政编制为62名（含直属分局14名、纪检单列编制1名），工勤人员编制6名（含直属分局1名）。处级领导职数：局长1职，副局长4职，纪检组长1职，副调研员1职。科级领导职数：科长22职（含机关党委专职副书记、总工程师、监察室主任、直属分局局长各1职），副科长32职（含直属分局副局长2职、乡镇国土资源所所长8职）。联系电话为0454-8246251，邮政编码为154004。主要职责是：（一）组织实施土地、矿产资源法律、法规和规章；研究制定管 理、保护与合理利用土地、矿产资源地方性配套政策建议；监督检 查土地、矿产资源管理执法情况；依照规定负责有关行政复议；依 法组织查处巿区土地和矿产资源违法案件和县（巿）局重大国土资源违法案件，以及县（市）人民政府及相关单位违反国土资源管理法律、法规的行为；指导全市国土资源行政执法工作，监督检查全市各级国土资源主管部门行政执法和土地、矿产的规划、计划执行情况；承办并组织调处权属纠纷。（二）制定国土资源市场、优化资源配置的政策和措施；组织重大课题调查研究和综合协调。（三）组织编制、修订和实施全巿土地和矿产资源综合性规划 及专項规划；制定土地利用年度计划并监督检查计划执行情况；指导和审核下级国土资源相关规划；参与报省、巿人民政府审批的涉及土地、矿产资源的相关规划审核；承担建设项目用地预审工作；制定有关国土资源区域、城乡统筹协调、综合利用等政策措施。（四）承担全巿耕地和基本农田保护、农地转用、土地征收、土 地复垦开发的监督管理工作；承办由国务院、省政府、巿政府审批的农用地转用和土地征收的审查、报批工作；承办乡镇企业、乡（镇）村公共设施、公益事业、农村村民住宅使用集体土地的审查、报批工作；负责实施农地用途管制；负责各类建设项目涉及占用耕地的占补平衡措施的审核和监餐检查、验收工作；组织编制土地整理复垦开发项目计划；负责组织土地复垦开发项目的立项、可研、设计及其成果的审查报批和项目竣工验收工作；承担耕地保护责任目标考核工作。（五）负责及时准确提供全巿土地利用各种数据的责任。拟定并组织实施地藉、土地确权、登记和权属管理办法；承办由巿人民政府颁发土地证书的土地登记工作；指导和组织全巿土地资源 调查、城乡地藉调查、土地利用现状调查、土地专项调查、土地统计、动态监测和登记发证等工作。（六）承担节约集约利用土地资源和规范国土资源巿场秩序的责任。按规定组织实施土地使用权出让、转让、出租、抵押、作价 出资入股、交易、政府收购和授权经营等工作；负责收缴、管理各项土地规费工作；指导基准地价、标定地价、囯有土地年租金标准的测评，审核土地使用权价格。 （七）负责全市矿产资源的综合管理，依法合理配置矿产资源，规划分配管理本地区审批、开发的矿产资源，并进行监督检查； 审核上报探矿权、采矿权的审批登记和转让审批登记。（八）依法管理地质环境及开发利用和保护工作；组织监测、 防治地质灾害和保护地质遗迹；依法管理水文地质、工程地质、环境地质勘查和评价工作；保护地质环境；负责全市矿泉水、地热水管理、开发、评价、保护；负责全巿地质环境监测站网的统一管理。（九）负责组织开展全巿矿产资源普查、调查和储量管理工作；承办全巿矿产资源补偿费征收入库工作；对本地区建设项目压 覆矿产资源储量进行登记工作；依法管理全市矿业权评估工作；管理地质资料汇交及有偿使用工作;负责本区域内矿产资源勘查证的审核报批工作，并对地质勘查、采矿权活动进行监督管理。（十）拟订土地划界、土地权属争议调处管理办法；承办中、省直单位和部队所属农、林、牧、渔、苇场的土地确权划界、落界登记工作；负责中、省直、部队所属单位、跨县（市）区域之间和市内其他重大土地权属争议案件的调处工作；指导县（市）土地确权划界和土地权属争议调处工作；协调处理信访事项，指导协调系统内信访工作。（十一）依法实施地质勘查单位在本区域内施工作业的监管， 监督检查国拨地勘费的使用；负责复核勘查登记及辖区内地质勘查活动的监督管理；参与地质勘查工作的质量管理及有关项目的验收；组织或参与地方地质勘查项目的立项论证、初审和申报工 作，组织项目实施及成果验收。（十二）依法征收国土资源收益和监管资金使用，依法组织土 地、矿产资源专项收入的征管，负责国土资源有关资金的預、决算和资产管理与监督，负责全市系统的内都审计工作。（十三）指导土地学会、矿泉水协会、土地、矿业宣传教有工作。（十四）承办省国土资源厅和巿政府交办的其他事项。 ",
