		"地理实体概况": "    佳木斯市水务局地址为长安西路812号市机关中心2号楼。市水务局设置9个职能科（室）。行政编制19名，工勤人员事业编制2名，离退休干部工作人员编制2名。局长兼党委书记1名，副局长3名，党委副书记1名，纪检书记1名，工会主席1名，调研员1名，助理调研员1名；科长10名，副科长1名。联系电话为0454-8437621，邮政编码为154004。主要职责：（一）贯彻执行国家、省水利工作方针政策和法律朵规，制定全市水利规范性文件并监督实施。（二）制订全市水务发展战略规划、中长期规划和年度计划并监督实施。（三）统一管理全市水资源（包括空中水、地表水、地下水）。组织拟定全市和跨行政区划的水长期供求计划，水量分配方案并监督实施；组织有关国民经济总体规划、城市规划及重大建设项目的水资源和防洪论证工作；组织实施取水许可制度和水资源费征收制度，发布全市水资源公报和全市排污口调查公报。（四）拟定节约用水政策、编制节约用水规划，制定有关标准，组织、指导和监督节约用水工作。（五）按照国家和省资源与环境保护的有关法律、法规、规章和标准，拟定水资源保护规划；组织水功能区的划分和向饮水区等水域排污的控制；负责组织全市水资源的监测和调查评价，审定水域纳污能力；提出限制排污总量的意见。（六）组织指导全市水政监察和水行政执法，协调仲裁部门之间、不同行政区划之间的水事纠纷，负责全市水行政复议和应诉工作。（七）拟定水利行业的经济调节措施；对全市水利资金的使用进行宏观调节；指导全市水利行业的供水、水电及多种经营工作。（八）贯彻实施水利行业技术质量标准和水利工程的规程规范；编制、审查中小型水利基建项目建议书和可行性报告；组织水利、水保科学研究和技术推广。（九）组织指导全巿水利设施、水域及其岸线的管理和保护；组织指导主要江河、湖泊及河口滩涂的治理和开发；组织建设和管理具有控制性的或跨行政区划的重要水利工程；组织指导水库、水电站大坝的安全监管。（十）指导全市农村水利工作，组织协调农田水利基本建设、水源性地方病的防治、人畜饮水工程建设、农材水电电气化建设和乡镇供水工作。（十一）组织全巿水土保持工作;研究制定水土保持的工程措施规划，组织水土流失的监测和综合防治。（十二）指导全巿水利行业对外经济技术交流和科技交流工作；指导全巿水利队伍建设。（十三）承办巿防汛抗旱指挥部的日常工作，组织协调、监督指导全巿防洪工作，对全市重要江河、湖泊和重要水利水电工程实施防汛抗旱调度。 （十四）负责城市供水、城市排水及污水处理工作。（十五）承办巿政府交办的其他事项。 ",
