		"地名的历史沿革": "    1990年全市党的民族宗教工作由市委统战部党派科主持。2002年体制改革，极据省委、省政府批准的《佳木斯巿党政机构改革方案》（黑编〔2001〕80号），佳编〔2002〕39文件，设置佳木斯巿民族事务委员会（佳木斯巿宗教事务局）（简称巿民委〔巿宗教局〕）。巿民委（巿宗教局）为主管全巿民族和宗教事务工作的巿政府工作部门。根据佳编〔2010〕63号文件，于2010年12月17日整合，名称未做改变，并沿用至今。",
