		"地理实体概况": "\"    佳木斯市民族宗教事务局地址为长安西路812号市机关中心2号楼，市民族宗教事务局机关行政编制为12名，工勤人员编制1名。处级领导职数：局长1职，副局长2职，纪检组长1职，副调研员1职。科级领导职数：科长3职。联系电话为0454-8223967，邮政编码为154004。主要职责是：贯彻执行国家和省有关民族、宗教政策和法律、法规；开 展民族、宗教政策和法律、法规宣传教育工作;检查民族、宗教政策和法律、法规的执行情况。研究民族、宗教理论和政策;组织对全巿民族、宗教情况的系统调查和对民族宗教问题的综合研究。提出协调民族关系的工作建议，参与协调处理涉及民族关系社会稳定工作;协调、办理有关保障少数民族各项权利、民族关系的有关事宜;组织开展民族团结进步活动；负责民族成份鉴定工作。提出少数民族和民族地区经济发展、社会事业方面的问题和政策建议；协调有关部门做好少数民族扶贫工作;负责民族统计工作。提出少数民族和民族地区教育、文化、科技、卫生、体育等项事业的政策和发展规划建议。广泛联系少数民族干部，协助组织、人事部门做好少数民族干部的培养、教育、使用工作。依法对宗教事务进行管理,保护公民宗教信仰自由,保护宗教教职人员正常的教务活动,保护宗教团体和宗教活动场所的合法利益；配合有关部门制止和打击利用宗教进行违法犯罪活动;依法登记和管理宗教活动场所;负责宗教场所的设立和大型宗教活动的审核、审批。指导宗教团体对宗教界人士和信教群众进行爱国主义、社会主义、维护祖国统一和法制教育，做好宗教界上层人士的工作,巩固和发展同宗教界的爱国统一战线，积极引导宗教与社会主义社会相适应。帮助宗教团体在宪法和法律规定的范围内按照各教特点开展工作；办理宗教团体需由政府机关协助或协调的各项事务；指导和支持宗教团体加强自身建设；帮助宗教团体搞妤自养和培训教职人员；做好宗教教职人员的审核、备案工作。配合有关部门及时处理由宗教问题引发的突发事件和影响社会稳定的问题。配合有关部门处理民族、宗教方面的涉外事务，开展有关民族、宗教方面的对外宣传工作；抵制境外敌对势力利用宗教进行渗透活动。（十一）指导县（巿）、区民族宗教工作。（十二）承办巿政.府交办的其他事项。 \"",
