		"地理实体概况": "    佳木斯市城乡建设局地址为坐落在长安西路818号，市行政中心三号楼5楼。市政府直属正处级单位，设13个内设机构。市城乡建设局机关行政编制48名（含纪检监察单列编制2名），工勤人员编制3名。处级领导职数：局长1职，副局长3职，纪检书记1职，副调研员1职。科级领导职数：科长19职（含机关党委专职副书记、离退休干部工作科科长、总工程师、总经济师、总会计师、监察室主任各1职），副科长4职。联系电话为0454-8289016，邮政编码为154004。主要负责是：（一）贯彻落实国家、省关于城巿建设、村镇建设、工程建设、建筑业、勘察设计咨询业、市政公用事业等方面的方针、政策、法规；研究提出城乡建设重大问题的政策建议，拟订城乡建设规范性文件以及相关发展战略、中长期规划和年度计划，并组织实施，进行行业管理。（二）贯彻工程建设实施阶段囯家、省标准定额和行业的标准定额，并制定全巿工程建设标准定额；组织实施建设项目可行性研究评价方法、经济参数、建设标准、投资估算指数、建设工期定额、建设用地指标和工程造价管理制度；监督指导各类工程建设标准定额的实施；贯彻工程造价咨询机构资质标准并监督执行。（三）组织并参与全市城巿基础设施和公用设施建设项目前期工作的论证；制定城市基础设施和公用设施建设项目年度预算内投资计划，并指导、监督、检查其计划执行情况；负责指导与管理全巿城乡建设计划与统计工作；负责制定巿政与公用设施管理的规范性文件并组织实施；负责巿区挖道和破道审批；负责环路费征管理工作。（四）负责指导和管理全巿建筑活动，规范建筑巿场；指导和管理建筑巿场准入、工程招投标、建设项目审批、施工许可、工程监理、工程质量和竣工验收；负责从事建设工程的新建、扩建、改建和拆除等有关活动及实施对建设工程安全生产的监督管理；负责公共建筑的装饰装修及居住建筑验收前的装饰装修的质量监督管理工作；组织或参与工程重大质量、安全事故的调查处理；指导企业拓外埠或国外巿场。（五）负责建设工程勘察、设计、施工、建设监理和相关中介组织的管理，规范建设工程勘察设计巿场；负责施工图审查和设计问题的处理；负责城巿基础设施和各类房屋建筑及其附属设施建设工程抗震设计规范的贯彻落实；会同人民防空主管部门共同搞好城巿地下空间的开发和利用；负责工程建设标准化和计量认证工作。（六）负责制定建设行业科技发展规划和技术经济政策，组织重大科技项目攻关和成果推广应用，指导重大技术引进和创新；推广应用新技术、新产品、新工艺、新型墙体材料，积极发展散装水泥事业；负责建筑节能工作。（七）负责指导和管理供热燃气、巿政设施、园林绿化、风景名胜区工作。（八）负责指导和管理全巿县域及村镇建设工作，组织指导农村住房建设。（九）负责组织政府投资项目的公开招标或委托等方式选择勘察、设计、招投标、代理、施工、监理等单位；监督施工项目建设全过程;控制投资、质量和工期，严格按批准的概算规模、标准，组织项目建设；组织竣工验收。（十）负责建设行业宏观管理和各项政策、管理法规、规章的拟定，指导建设行业的经济体制改革。 （十一）承办市政府交办的其他事项。",
