		"地理实体概况": "    佳木斯市司法会计中心地址为友谊路177号，东临佳木斯市消防支队，南临西浦植物园，西临西浦植物园，北临友谊路。隶属于佳木斯市人民检察院，为科级事业单位。人员编制6人，设主任一职。所属行业为公共管理，联系电话为0454-8620003，邮政编码为154004。业务范围为司法会计检查、司法会计鉴定和司法会计检验、司法会计文证审查，其主要职责是：目前我国已经开展的司法会计活动主要有司法会计检查、司法会计鉴定和司法会计检验、司法会计文证审查四类。（一）司法会计检查在诉讼中：为了查明案情，对案件涉及的财务会计资料及相关财物依法进行专门检查的一项司法会计活动。通俗的讲，司法会计检查就是指诉讼中所进行的查账、查物活动。其目的是为了寻找、发现、收集和固定有关财务会计资料和财产状况方面的诉讼证据。司法会计检查的诉讼结果，包括获取财务会计资料证据和形成司法会计检查笔录。（二）司法会计鉴定：在诉讼中，为了查明案情，指派或聘请具有司法会计专门知识的人员，对案件中需要解决的财务会计问题进行鉴别判定的一项司法会计活动。司法会计鉴定，通过解决诉讼涉及的财务会计问题，获取司法会计鉴定意见作为诉讼证据，从而达到查明财务会计事实的目的。（三）司法会计检验：司法会计检验，泛指司法会计师对案件所涉及的财务会计资料及相关证据进行检查、验证的技术活动。它包括两种情形：一是指司法会计检查中的技术检验活动，即司法会计师接受指派或聘请，参与对案件涉及的财务会计资料及相关证据进行的技术性检查、验证活动。二是指司法会计鉴定中的技术检验活动，即司法会计鉴定人为了解决鉴定问题而对案件涉及的财务会计资料及相关证据进行的技术检查、验证活动。（四）司法会计文证审查：司法会计文证审查，是指为了判明涉及财务会计业务内容的文书证据能否作为定案的根据，运用证据审查的原理与方法，对文书证据进行审查、评断的一项司法会计活动。狭义的司法会计文证审查专指司法会计师对文书证据进行的技术性审查、判断活动。与前述司法会计活动的不同在于：司法会计文证审查其目的不是为了获取财务会计资料证据、检验结论或鉴定意见等证据，而是为了判明涉及财务会计业务内容的证据能否作为定案的依据。 ",
