		"地名的来历": "    由佳木斯市机构编制委员会办公室于1994年根据佳郊编〔1994〕25号文件，组建并命名为佳木斯市郊区船舶管理站。",
		"地名的含义": "    因其位于佳木斯市郊区，主要负责郊区范围内的船舶管理工作。",
		"地名的历史沿革": "    1994年8月1日成立时称佳木斯市郊区船舶管理站，名称沿用至今。",
