		"地理实体概况": "    佳木斯市郊区船舶管理站地址为友谊路275号，郊区第二行政中心北楼内，隶属于佳木斯市郊区交通运输局。人员编制3人，设站长一职。所属行业为公共管理，联系电话为0454-6045200，邮政编码为154004。业务范围为船舶管理，其主要职责是：一、宣传贯彻水上交通管理的法律、法规、规章及上级有关文件。二、组织在本辖区从事水上服务的从业人员参加每月安全学习、例会，对从业人员进行经常性的安全知识培训教育。三、督促船舶所有人、经营人遵章守纪，完善有关证书、证照，协助航务（海事） 门征收各项水路交通规费。四、组织镇船舶的从业人员，参加海事部门组织的安全学习、技术培训和考试。五、负责具体办理本辖区生产自用船舶的登记、年检审工作。六、具体负责本辖区船舶日常安全管理；落实三级责任制；落实本辖区渡口“五定”工作；制定本辖区安全保障措施，进行现场安全检查；维护节假日、重大集会的客（渡）运秩序；制止违章，落实隐患整改。七、具体负责海事机构委托执法权限范围内的水上违章案件的处理并按执法程序操作，处理结果及时上报有关海事机构备案。八、负责完善本区管船制度和建立健全本行政区域从事水上服务的船舶、人员基础资料、台帐，整理和管理本区的船舶管理档案资料，指导和帮助水上安全联组开展活动，按规定向 区政府和当地海事处书面汇报安全管理工作情况。九、负责制定年初工作计划，及时总结半年、全年及专项安全工作情况和安全管理工作的先进经验；负责收集整理水上安全工作信息，及时汇总上报区政府或海事部门；负责本区水上交通安全管理统计上报工作。十、做好日常安全管理和客（渡）船发航签单工作。十一、督促本区管理的船舶修造厂、点按照国家有关规定从事船舶修造业务。十二、具体处理乡镇船舶在本辖区水域内发生的一般运输纠纷和未上等级小事故案件的协调工作。十三、加强镇自用船、渔船管理，禁止其从事旅客或货物运输。十四、本辖区发生水上交通事故立即报告当地政府和海事机关，并及时赶赴现场，维护现场秩序，协助海事机关调查处理水上交通事故。十五、办理区政府和海事部门交办的其它工作。 ",
