		"地理实体概况": "    佳木斯市消费者协会办公室地址为长安西路812号市机关中心4号楼，隶属于佳木斯市工商行政管理局，为科级事业单位。人员编制10人，设办公室主任一职所属行业为公共管理，联系电话为12315，邮政编码为154004。业务范围为消费证权益保障，主要职责是：(一）综合保障部1.行政事务管理、后勤保障和综合协调；2.财务及物资设备管理；3.文件收发、档案管理；4.车辆保养、管理和调度。(二）组织联络部1.各级消费者协会和基层组织建设及消协系统工作人员培训;2.组织召开理事会、常务理事会、秘书长工作会议;3.制定各项工作制度，编制上报工作报表;4.组织对各市协会工作的考核，评选系统先进;5.省消协理事的日常联络及组织发展3?15志愿者;6.指导各区协会的自身建设。(三）宣传教育部1.制定实施消协年度宣传计划，与新闻媒体进行日常联络及组织新闻发布会;2.《消费者权益保护法》、年主题及315国际消费者权益日等宣传活动的筹划和实施;3.组织开展和推进国民消费教育，编写指导消费的书籍;4.收集、研究、编辑有关消费者权益保护工作的史料和文献，开展消费者权益保护的理论研究;5.起草综合文件;6.消费者权益保护法制建设;7.指导各区协会的宣传工作。(四）消费指导部1.组织开展商品比较试验;2.组织开展对商品和服务的消费调查;3.参与有关行政部门对商品和服务进行的监督检查;4.组织发布消费警示;5.向社会推荐商品和服务，评选省级消费者满意单位;6.指导各区协会的引导消费工作。(五）投诉事务部1.受理消费者投诉;2.就有关消费者合法权益的问题向有关部门反映、查询、提出建议;3.对损害消费者合法权益的行为，通过大众传播媒介予以揭露、批评，对投诉热点、难点问题进行适用法律法规的调查研究;4.组织编写投诉分析和投诉案例;5.开展消费者权益争议仲裁工作;6.指导各区协会的投诉事务工作。(六）信息咨询部1.向消费者提供消费信息和咨询服务;2.收集、整理商品和服务等消费信息;3.开发、整合消协系统专有信息资源;4.向政府及有关部门、企业反馈消费信息;5.开展在网查询、在网交流信息等网上服务工作;6.指导各区协会的信息咨询工作。(七）法律支持中心1.解答消费者的法律咨询;2.为受商品或服务质量损害的消费者代拟法律文书;3.消费纠纷的非诉讼事务调解与代理;4.为受商品或服务质量损害的消费者代理诉讼与辩护;5.组织社会各方面力量参与消费维权活动;6.其他形式的法律服务；7.指导各区协会的法律支持工作。 ",
