		"地理实体概况": "    佳木斯市郊区畜牧卫生防疫站地址为友谊路275号，郊区第二行政中心南楼内。隶属于郊区畜牧兽医局。人员编制5人，防疫站设站长1职，副站长1职。所属行业为卫生防疫，联系电话为0454-6118516，邮政编码为154004。业务范围为畜牧卫生防疫工作，其主要职责是：1、贯彻“预防为主”的方针和有关防疫法规宣传防治畜禽疫病的主要意义，编写宣传材料及兽医科学知识。2、根据本地区畜禽疫病的流行特点，制定畜禽防疫计划，组织实施和检查防疫检疫工作，掌握情况并做好技术指导、问题处理。3、掌握疫情及时报告、采取措施、就低消灭、加强联防、互通情报、共同防范。4、认真总结经验，搞好调查研究，逐步摸清疫病分析和流行规律，培养典型、树立样板、以点带面，推动防疫工作。5、由计划的逐步开展培训兽医防疫人员，特别要加强基层乡、村、场（户）的兽医防治人员的轮训工作。不段提高其生产效益。6、开展生产中的科研，推广应用普及新技术、新知识、新成果，不段提高政治思想和技术水平。7、做好防疫所需要的疫苗，诊断液体、药械、器材的计划，领取和发放供应工作。8、按照国家有关规定，对违范国家有关规定的单位和个人，根据情节执行处罚，提出处理意见。",
