		"地名的来历": "    1998年佳木斯市政府根据佳编办[1998]74号文件，组建佳木斯市防汛机动抢险队。",
		"地名的含义": "    因其位于佳木斯市，主要负责全市的水利工程防汛抢险相关工作而得名。",
		"地名的历史沿革": "    1998年成立时称佳木斯市防汛机动抢险队，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市防汛机动抢险队地址为长安西路812号市机关中心2号楼，隶属于佳木斯市水务局，为科级事业单位。核定编制16人，设队长一职，副队长2职。所属行业为公共管理，联系电话为0454-8437621，邮政编码为154004。业务范围为水利工程防汛抢险，是经国家防办、市机构编制委员会、市水务局批准成立的机动抢险专业队伍，其职责为：一、根据市防汛抗旱指挥部的要求，参与市内水利工程防汛抢险方案的制定，实施和防汛抢险物资调运，进行防汛抢险的技术指导，以及防汛应急抢险、防汛岁修建设和水毁工程修复等任务。二、认真学习《中华人民共和国防洪法》、《中华人民共和国防汛条例》、《江西省实施（中华人民共和国防洪法）办法》等有关防洪法律法规，学习、落实上级及本级防汛指挥部有关防汛抢险工作的文件精神，执行市防汛抗旱指挥部的命令，遵守防汛机动抢险队规章制度和纪律。三、根据市防汛抗旱指挥部的统一安排，在队领导的直接领导指挥下，制定具体抢险计划和方案。接到抢险命令迅速组织机械、车辆、人员、物资奔赴抢险现场，实施抢险、救援任务。四、市防汛机动抢险总队下设办公室和技术分队、应急抢险救援分队和物资供应分队等4个分队，由市防汛办负责协调管理。五、办公室和各分队的具体职责为：办公室承担文秘、档案，党、工、人事教育、计划财务及后勤等工作；技术分队负责防汛抢险的技术指导；应急抢险救援分队担负工程险情的抢护任务；物资供应分队负责防汛、抢险物资的储备、供应工作。六、建立健全岗位责任制、资金管理、设备管理维护使用、收费和职工培训等各项规章制度。七、非汛期积极参加水利工程及其他工程施工，抓好经营创收，实现自我发展。八、要加强对抢险机械、车辆及其他设备的维护和保养，保证防汛抢险的急需。九、加强抢险队伍的施工技术、抢险知识培训，提高快速反应能力，不断适应新形势下防汛、抢险工作的要求。",
