		"地理实体概况": "    佳木斯市郊区大来镇农业畜牧技术综合服务中心地址为佳木斯市郊区大来村，办公地点位于郊区大来镇政府办公楼内。所属行业为公共管理、社会保障和社会组织，联系电话为0454-8871043，邮政编码为154013。其主要职责是：1、协助镇政府制定农业长远发展规划和年度计划，指导和组织农村集体、个人开展各项农业生产经营活动。2、指导农业产业化、标准化建设，指导农业基地建设、农业名牌产品申报和创建工作。3、承办实施农业新技术、新品种、新机械等试验、示范、推广工作。4、农业资源和农业生态环境监测，生态农业建设，指导无公害、有机食品建设和申报工作，协助做好农业植物检疫工作。5、组织指导农业救灾工作。6、农业技术培训，农业技术、信息、收集、整理、发布。7、宣传与贯彻执行《森林法》和林业方针、政策，了解反映群众在发展林业生产中的要求和问题。8、配合林业调查设计单位开展资源调查工作，负责造林检查验收、林业统计和森林资源档案管理，掌握本辖区内的森林资源消长变化情况。9、积极宣传党和政府有关农机化方针、政策和认真贯彻执行省农机管理条例。10、制订本镇农机发展规划，做好本镇农机管理服务体系建设工作。11、切实做好本镇农机“计划、劳动、机务、财务”管理工作，指导村委与农机经营户及农户签订农机作业合同，并监督合同的实施和协调农机为农服务活动。12、积极引进示范推广新型适用农业的机械，切实抓好全镇农机人员的业务、技术、培训工作。13、认真做好农机安全、监督、管理和核发牌证及年检年审工作，达到提高机手素质，提高机械技术状态，确保安全生产。 14、负责畜禽生产技术指导、重大动物疫病防治等工作。15、负责畜禽品种、技术、知识三大更新工程的组织实施和畜禽养殖基地建设工作，大力推进畜牧兽医技术创新。16、负责《动物防疫法》、《种畜禽管理条例》、《兽药管理条例》等相关法律、法规、规章的学习宣传和贯彻实施。17、负责兽医卫生工作和监督检查。18、承办镇党委、政府和上级业务主管部门交办的其他工作任务。",
