		"地理实体概况": "    佳木斯市企业集团博士后工作站地址为长安西路820号，市行政中心八号楼，隶属于佳木斯市人力资源和社会保障局，为科级事业单位，核定编制16人，设站长一职。所属行业为公共管理，联系电话为0454-8551800，邮政编码为154004。业务范围为企业和集团博士后交流、服务和管理，主要职责：1. 拟（修）订博士后工作站相关管理制度，并与相关职能业务部门会商后，提交（副）站长审核、审批；2. 同博士后工作站上级主管部门、有关博士后流动站保持日常沟通和联系，促进相关工作的顺利开展；3. 提出年度招聘博士后拟研究的课题项目和人员需求，并会同人力资源部及课题承接单位等招募博士后；4. 组织相关专家（内外部专家、承接单位）对入围博士后人选进行评估考查；5. 为博士后科研课题立项（含科研预算），申请、审核、管理和监控博士后人员的科研经费; 6. 为入站博士后协调配置导师，组织内、外部相关专家对博士后研究人员进行中期与期满出站的业务考核，按规定发放成果奖金；7. 办理博士后人员出入站相关手续，协助经考核合格出站的博士后研究人员办理《博士后证书》。 ",
