		"地名的历史沿革": "    1959年1月15日，成立佳木斯市档案馆，1964年4月成立佳木斯市档案管理处，1967年11月佳木斯市革命委员会在办公室内设档案组，1973年7月市委办公室设档案科，1979年7月市委决定回复档案处，1980年7月又改为市档案局。虽机构几经易名，但其工作职能均无变化。1985年1月，原合江地区档案处并入市档案局，实行局、馆合一体制。2002年根据市委、市政府批准的《佳木斯市党政机构改革方案的实施意见》（佳编〔2001〕28号），佳编〔2002〕63号文件，佳木斯市档案局与佳木斯市档案馆实行局馆合一，保留佳木斯巿档案局牌子（简称市档案局〈馆〉），名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市档案局地址为黑龙江省佳木斯市郊区长安西路818号，行政中心7号楼。库房5间、资料室2间、办公用房与技术用房19间，总面积约3000平方米。设10个职能科（室）。行政编制13名，事业编制30名，工勤人员事业编制1名。领导职数：局（馆）长兼市志办主任1名，副局（馆）长3名，巿志办副主任1名；科长12名，副科长5名。所属行业为行政管理，联系电话为0454-8246051，邮政编码为154004。业务范围为履行全市档案事业行政管理和档案保管利用两种职能，主要职责是:（一）贯彻执行党和国家有关档案工作、地方志工；作的方针、政策和法规、制度；组织、指导、检查、监督、协调巿直机关和各县（市）区及企、事业单位的档案业务和修志工作，并对全市档案工作和地方志工作实行统筹规划，宏观管理。（二）组织、协调全巿档案教育、宣传、科学技术研究、执法监督检查工作和档案业务的对外交流与合作。（三）制定档案工作人员队伍建设规划，组织档案专业干部培训工作。（四）集中统一管理全市重要档案、资料，保守党和国家机密，维护档案的完整，确保档案的安全。（五）负责接收、征集、整理、保管巿直机关重要档案、资料，推进档案的科学化管理和现代化建设，开发档案信息，编辑出版档案史料，为社会提供利用。（六）负责巿志编委会的日常工作，代表市志编委会承办地方志有关事宜；负责编撰《佳木斯巿志》、《佳木斯年鉴》和印刷、出版、发行工作。（七）负责撰写出版《佳木斯地方简史》和各类专业史书、乡土资料，并为各级领导和有关部门提供历史资料。（八）承办巿委、市政府交办的其他工作。",
