		"地理实体概况": "    佳木斯市郊区四丰乡农村经济管理中心地址为佳木斯市郊区四丰村，办公地点位于郊区四丰乡政府办公楼内。中心设主任1职。所属行业为公共管理，联系电话为0454-8881777，邮政编码为154015。业务范围为农村各项经济活动监督、管理、指导，其主要职责是：1、按照市农业局的要求，积极做好农工办布置的各项工作任务。按时按质完成好各类农经统计报表的编报工作。2、落实土地承包政策，积极搞好土地流转管理，督促各村严格执行《农村土地承包法》，按规定落实好农民的二次分配。同时做好有关农村、农业、农民利益方面的各类来信来访的调处工作，确保社会稳定。3、围绕农村稳定、农业增效、农民增收这个主题，开展调查研究，为领导决策提供服务，当好领导参谋。4、加强农业资金管理，抓好农业资金的收支和帐户的核算工作。5、加强对镇财务结算中心记帐员的指导管理，切实搞好村(组）财务镇级代理工作。加大财务监督力度，严格执行好财务管理制度，确保村组集体资金的安全和保值增值。6、贯彻上级文件精神，落实农民负担政策，巩固农村税费改革成果。经常开展农民负担执行情况的检查，严防各村自定收费项目的现象发生。7、抓好村务公开、民主管理工作。按季进行村务公开活动，不断提高村务公开的质量和效果，达到群众满意。8、组织开展村级财务的审计，按照党委年初责任制考核的意见，认真做好村干部报酬的年度考核结算工作。9、抓好村级档案管理，确保档案局每三年循环一次的复查复验全部合格。10、做好经济薄弱村的帮扶和农村基本现代化建设的有关工作及经济条件较好村的新农村建设示范相关工作。",
