		"地理实体概况": "    佳木斯市华侨经济联络信息中心地址为长安西路812号，市行政中心4号楼3楼，隶属于佳木斯市归国华侨联合会，科级事业单位，事业编制七人，设中心主任一人。所属行业为公共管理，联系电话为0454-8511515，邮政编码为154004。业务范围为华侨经济方面工作，其主要职责是：1、贯彻执行党和国家的对外方针政策及有关规定，并根据我市外事工作的具体情况制定和完善涉外工作的各项规章制度，负责掌握各涉外部门的贯彻执行情况。2、做好外事归口管理工作，指导协调和掌握各涉外部门的外事工作和涉外活动。3、做好外事调研工作，为市委和市政府的对外工作决策提供意见和建议。4、审核全市各部门报请市委、市政府审批的外事文件；承办全市领导出访的有关事宜；审核或根据授权归口上报我区临时因公出国人员的有关手续和邀请外国人来华访问的有关事宜。5、负责组织接待来我市访问的国宾和其它重要贵宾；接待来我市进行公务活动的外国驻华外交人员；统筹安排市党政领导会见外宾和会谈礼仪等有关事宜。6、会同有关部门做好对外开放地区和外宾参观点的辟建、开放工作。7、了解和检查全市所属因公出国团组和人员在国外的活动情况。做好全市因公出国和邀请外国人来访情况的总结上报工作。8、负责开展友好地区、友好协会工作，管理扎区与友好地区及其它结好单位的友好交往活动，指导全市民间对外交往工作，落实已签订友好协议地区的具体工作内容。9、负责向全市各部门提供国际形势、对外政策和重大国际问题的宣传材料和对外表态口径；协同审核全市重要涉外报道稿和有关文稿。10、负责对全市外事干部和涉外人员进行对外政策和外事纪律的教育和培训，配合纪检、监察和保密部门检查外事纪律及保密制度的执行情况；配合有关部门做好涉外案件的处理工作。11、会同有关部门管理全市的外事业务及涉外事宜；指导并参与外事会谈、会晤工作。12、办理市委、市政府和上级外事部门交办的事项。",
