		"地名的来历": "    2013年改称“佳南实验农场江口管理区”。",
		"地名的含义": "    因地处佳木斯市郊区莲江口镇，故得名佳南农场江口管理区。",
		"地名的历史沿革": "    始建于1957年，建立“黑龙江省公安厅佳木斯地区良种场”。1963年改称“黑龙江省公安厅合江良种场”。1968年到1969年期间下放给汤原县管理称“汤原县国营良种场”。1970划归省国营农场管理局合江分局管理，称“合江良种场”。1974年改称“合江实验农场”。1977年与宝泉岭农场管理局科研所合并，称“宝泉岭农场管理局科研所”。1981年划归农垦科学院，2009年3月合并到佳南实验农场，改称“佳南实验农场江口作业区”。2013年改称“佳南实验农场江口管理区”，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳南实验农场江口管理区所在行政区为莲江口镇，位于莲江口镇政府西2千米处，莲江口农场西1千米处。东临佳木斯监狱，南临绥佳铁路线，西临鹤大高速，北临莲江口农场第一生产队。佳南实验农场江口管理区设有育种研究室、品质育种研究室、生物育种研究室、杂交稻研究室、基础研究室、栽培研究室、生态研究室、实验室和哈尔滨试验站；核心研究试验基地2处。拥有生物工程育种实验室、生理生化实验室、微生物实验室、土壤化验室，配备有100多台套先进仪器设备，总价值1500余万元。现有以硕士、博士研究生为骨干的中青年科技人员44名。其中博士研究生6人、硕士研究生25人、高级职称21人、中级职称19人。学科梯队建设完善，科研实力雄厚。水稻栽培学科为省重点学科，育种学科为总局重点学科。并具有完备的科研手段、试验示范基地、种子资源贮备和数十项先进的科研成果的推广应用。管理区面积为11.32平方千米，有居民377户，1020人。年均气温为3.6摄氏度，年均降水量为538.70毫米，年无霜期为127天，主要产业为培育水稻，现以“水稻科学研究、科技服务、国内外学术交流和人员培训”为中心，学习和引进国内外先进的科学技术；以多年收集和创制的水稻资源为基础、常规育种和生物育种技术并重，开展寒地水稻优质高产新品种创新研究，提高水稻品质、抗性、产量。以实现寒地水稻全程机械化生产和现代化农业为目标，走自主研发之路，进一步开展良种良法集成配套技术研究，提高综合防控病虫害能力和应急减灾能力，实现寒地水稻提质增产增效。 ",
