		"地理实体概况": "    佳木斯市市直机关事务管理局地址为长安西路816号，市行政中心六号楼，市机关事务管理局设8个内设机构。行政编制30名，工勤人员编制11名。处级领导职数：局长1职，副局长3职，纪检书记1职，副调研员1职。科级领导职数：科长9职（含机关党委专职副书记1职），副科长4职。所属行业为公共管理，联系电话为0454-8511001，邮政编码为154004。业务范围为市直机关事务管理工作，主要职责：（一）贯彻执行党和国家的方针政策，制定市直机关事务管理工作的有关规章制度和工作计划并组织实施；负责对巿直机关单位后勤工作的指导；统一后勤管理制度和服务标准，规范管理工作程序。（二）负责巿直机关行政办公用房的管理工作；负责制定办公用房物业管理办法，并依据相关规定进行检查指导；负责巿政府授权的国有资产清理、核实、变更和管理；负责政府办公用房维修、改造的监督检查工作。（三）负责巿委、巿人大、市政府、巿政协领导办公场所服务保障、会议服务和外事会见服务；负责巿级领导办公用品的采购、管理工作；负责机关中心的后勤服务管理工作。（四）负责机关中心的安全保卫工作，维护机关中心办公秩序。（五）负责局属车辆的管理保障等工作。（六）指导并组织实施全巿机关单位后勤人员培训工作。（七）负责拟订巿级领导服务保障有关规章制度并组织实施。副市级以上领导的生活服务工作；负责上级下派我巿副巿级以上领导周转房的管理工作。（八）承担推进、指导、协调、监督全巿公共机构节能工作；研究拟订和贯彻落实全巿公共机构节约能源管理的相关制度；组织开展能耗统计、监测和评价考核工作；负责巿直单位公共机构节约能源监督管理工作；负责拟订巿直公共机构节能规划及相关制度并组织实施；负责巿直公共机构节能缋效评估工作。（九）承办巿委、巿人大、巿政府、市政协交办的其他事项。",
