		"地理实体概况": "    民兴村所在行政区为沿江乡，类型为农村，聚落形状为团状。位于沿江乡政府西5千米处。范围为东临东兴屯，南至完达山脉猴石山脚下，西林松花江，北与泡子沿村毗邻。东北抗日10联军战绩纪念塔座落在境内猴石山主峰东北坡二四四高地上。哈同高速公路从村南通过。佳依公路在村中穿过。村下辖东兴自然屯。居民点面积0.35平方千米，有居民701户，2702人。村经济以农业为主。农作物主要为蔬菜。村内有蔬菜温室13栋，蔬菜大棚24栋，种植的秋菜、萝卜远销周边市县。村设小学校1所，为1200平方米教学楼。村内道路全部为水泥路面。村党支部和村民委员会设在此屯。2005年被评为市级文明村。长途电话区号为0454，邮政编码为154011，新农村建设中，村路全部硬化，交通便利，村内安装有路灯、有线电视，自来水入户率100%。",
