		"地名的含义": "    因其位于佳木斯市郊区，负责郊区境内的机关事业社会保险的日常登记、审核等管理工作而得名。",
		"地名的历史沿革": "    佳编办[1992]114号文件同意成立佳木斯市郊区社会保险事业管理站。佳郊编〔1994〕3号文件收悉，佳编办〔1994〕14号文件，1994年3月30日成立时叫郊区机关社会保险公司，隶属于郊区人事局。1997年更名为郊区机关事业社会保险局。2000年隶属关系变更为郊区劳动局，2005年更名为佳木斯市郊区机关事业社会保险管理局。2010年人事局和劳动局合并，隶属于郊区人力资源和社会保障局，名称沿用至今。",
