		"地理实体概况": "    佳木斯市郊区机关事业社会保险管理局地址为佳木斯市郊区友谊路8号，郊区政府一楼105、107、109、106、108、115，隶属于郊区人力资源和社会保障局，人员编制3人，设局长1职。所属行业为公共管理，联系电话为0454-8595982，邮政编码为154004。业务范围为机关事业社会保险管理，其主要职责是：１、认真贯彻执行国家、省、市关于机关事业单位社会保险工作方针、政策。２、依据国家、省、市关于机关事业单位社会保险工作的方针、政策，结合本地实际，起草有关社会保险的法规，研究制定社会保险发展规划和实施方案。３、负责拟定机关事业单位社会保险经办机构进行社会保险登记、审核社会保险缴费申报、开展社会保险费征缴、拨付以及办理社会保险关系建立、中断、转移、接续和终止工作的办事程序与操作规范并组织实施。4、拟定机关事业单位社会保险经办机构管理单位和个人社会保险缴费记录、档案等业务工作规范并组织实施。5、负责复核参保的机关、事业单位人员退休待遇标准。６、执行社会保险基金财务、会计制度，编制机关事业单位养老保险基金年度预决算报告。7、做好社会保险宣传工作，促进社会保险制度改革的深化，增强职工的自我保险意识和参与意识。8、积极搞好社会保险制度改革的研究和探讨。",
