		"比例尺": "1:50000",
		"使用时间": "现今地名",
		"地名的来历": "    2002年佳木斯市国土资源局根据佳编办[2002]21号文件，组建佳木斯市国土资源二处。",
		"地名的含义": "    因其位于佳木斯市，主要负责全市国土资源管理。",
		"地名的历史沿革": "    2002年成立时称佳木斯市国土资源二处，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市国土资源二处地址为长安西路818号，市行政中心3号楼，隶属于佳木斯市国土资源局，为科级事业单位，核定事业编制21名，设处长一职。所属行业为公共管理，联系电话为0454-8246791，邮政编码为154004。业务范围为国土资源管理，主要职责：一、宣传贯彻执行国家和省有关国土资源管理法律法规、方针政策，以及市、县依据国家法律法规作出的有关国土资源管理的决定和措施。二、依据上级土地和总体规划，参与编制和实施本行政区域的土地利用总体规划，矿产资源总体规划，地质环境保护总体规划及其它专项规划，协助做好规划听证工作。三、开展耕地保护特别是基本农田保护工作，具体实施基本农田划区定界，协助编制土地开展整理、复垦计划，并对实施情况进行监督管理。四、协助上级国土资源管理部门开展本行政区域内的土地资源调查，土地分等定级、土地登记、土地统计、地籍档案管理、土地证书核发和土地动态监测管理工作。五、负责农村居民住宅用地以及乡镇村公共设施、公益事业建设用地的审核报批及批准后的组织实施和监督管理工作。六、协助上级国土资源管理部门开展农用地转用，集体土地征收（征用），具体建设项目供地等有关工作。七、维护矿产资源勘查，开发秩序，对行政区域矿业权人履行法定权利义务，矿产资源的开发利用与保护进行监督管理。受上级国土资源管理部门委托，可参与采矿权设置的论证工作。八、协助上级国土资源管理部门开展矿山生态环境的监督、保护工作以及地质灾害监测，防治工作，组织对地质灾害点的监测预报工作，对地质灾害群测群防工作落实情况进行监督。九、对本行政区域内的国土资源进行动态巡查，及时发现，制止和报告国土资源违法行为，配合上级国土资源管理部门做好国土资源管理部门做好国土资源违法案件的调查核实，取证和处理工作。十、做好本行政区域内各项土地、矿产资源费税的收缴管理工作，按“收支两条”原则足额，及时上交。十一、做好本行政区域内国土资源信访接待工作，及时调处和化解矛盾，发现重大上访苗头，及时向当地党委、政府和上级国土资源管理部门报告。十二、负责对本单位国土资源管理工作中形成的文件材料进行收集、整理、鉴定、保管、统计、检索和利用。 ",
