		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市郊区工程质量监督站地址为友谊路8号，郊区行政中心办公楼内。隶属于郊区建设与环境卫生管理局。设站长1职。所属行业为公共管理，联系电话为15904542233，邮政编码为154004。业务范围为辖区内城镇规范区以外的新建、改建、扩建的生产性设施，公共设施及成片的住宅小区和“三资”建设项目进行监督管理，其主要职责是：（一）受郊区住房和城乡建设局委托，负责郊区建设工程质量管理工作。对新建、扩建、改建各类建筑工程质量和质量行为实施监督；（二）具体贯彻落实国家及省制定的有关工程质量的法律、法规和工程技术标准；（三）按照国家及省制定的有关工程质量管理的法律、法规和工程技术标准，对受监工程建设各方责任主体及有关机构履行质量职责情况和工程实体质量情况进行监督检查。重点是核查建设、勘察、设计、施工、监理等建设各方主体的资质及有关人员的资格、质量保证体系和质量责任制落实情况，检查有关质量文件、技术资料是否齐全并符合规定；（四）向工程备案机构提交工程质量监督报告；（五）按照建设行政主管部门的委托权限对责任主体和有关机构违法、违规行为进行调查取证和核实，提出处罚建议或按委托权限对违法违规行为实施行政处罚；（六）受理并及时处理郊区建设工程质量投诉，参与郊区质量事故的调查处理；（七）依据工程建设强制性标准，按照质量监督工作方案，对建筑工程地基基础、主体结构和其它涉及结构安全的关键部位进行实体质量检查。对用于工程的主要建筑材料、构配件的质量进行抽查。对地基基础分部、主体结构、节能分部工程和其它涉及结构安全部位的质量验收进行监督。（八）对工程竣工验收进行监督。监督建设单位组织的工程竣工验收的组织形式、验收程序以及在验收过程中提供的有关资料和形成的质量评定文件是否符合有关规定。并按有关规定，向市建设行政主管部门报送工程质量监督报告。（九）负责对建筑工程及工程材料、产品、设备进行监督检测，并对全区建筑检测工作实施管理。（十）掌握郊区建设工程质量状况，及时总结、推广好的工程质量管理经验；（十一）完成郊区住房和城乡建设局委托的其他工作。 ",
