		"地名的来历": "    由佳木斯市郊区教育体育局上报，佳木斯市机构编制委员会办公室于2007年根据佳编办[2007]38号文件，命名为佳木斯市郊区敖其赫哲族联合学校。",
		"地名的含义": "    因其位于佳木斯市郊区敖其镇，且主要负责境内的适龄儿童的小学、初中阶段的义务教育工作而得名。",
		"地名的历史沿革": "    1950年成立，称永安中心校。1977年称敖其中心校。2007年根据佳编办[2007]38号文件同意将郊区敖其镇中、小学合并，组建佳木斯市郊区敖其赫哲族联合学校，名称沿用至今。",
