		"地名的来历": "    2010年根据根据省编办〔2010〕095号和佳郊编发〔2010〕7号文件，组建并命名为佳木斯市郊区票证管理站。",
		"地名的含义": "    因其位于佳木斯市郊区，主要负责对郊区范围内的行政事业性收费票据及罚没票据的管理的工作而得名。",
