		"地理实体概况": "\"    佳木斯市财政国库集中收付中心地址为长安西路808号，东临益海花园，南临职教集团，西临气象局，北临气象花园。核定事业编制25名，内设受理审核科、综合科、非税收入科、直接支付科；设主任（副处级）1职，副主任〔科级）1职，科长4职。所属行业为公共管理，联系电话为0454-8661872，邮政编码为154004。业务范围为财政国库集中收复，一、具体办理财政支付业务，根据预算股批复的预算单位用款计划，接受并审核预算单位的直接支付申请，及时办理单位财政直接支付业务；监督代理银行办理财政资金直接支付和授权支付业务。二、管理和使用国库单一账户体系有关账户,具体包括财政零余额账户、预算单位零余额账户、特设专户等。三、负责办理财政零余额账户和预算单位零余额账户的开设、变更和撤销等事宜；监管零余额账户的使用范围；管理各预算单位直接支付和授权支付预留印鉴卡。四、接收预算股核批的部门用款计划，监控单位预算指标与用款计划余额。五、核算国库集中支付的执行情况，具体负责财政零余额账户和预算单位零余额账户明细账的核算，分月与业务股室、总预算会计、清算银行、代理银行、预算单位对账。六、管理国库支付信息，汇总并及时向有关业务股室提供财政资金支付和清算信息；受理预算单位查询有关支付信息和投诉。七、每日从系统中打印出直接支付凭证和授权支付额度通知单，同时打印财政直接支付汇总清算额度通知单和财政授权支付汇总清算额度通知单，分别送清算银行和财政局国库股。八、集中管理国库集中支付制度所使用的各种凭证和票据。九、对财政专户的管理，主要包括社会保障资金、基本建设资金等专户资金,按规定的审批程序和手续拨付资金，并进行会计核算等管理工作。十、按照《会计法》等国家财经法规，会同有关股室对预算单位财政资金运作及其执行财经纪律状况进行监督。十一、积极推进国库管理制度的改革，加强对各项财政资金的管理，及时掌握资金动态，确保资金运行安全。 \"",
