		"地名的历史沿革": "    1962年根据佳编字[1962]31号文件成立佳木斯市水利勘测设计队。1985年根据佳编办[1985]3号文件，将原市水利局变为郊区水利局，佳木斯市水利勘测队同时更名为佳木斯市郊区水利勘测设计队，名称沿用至今。",
