		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市郊区水政水资源管理办公室地址为佳木斯市郊区友谊路417号郊区政府二办。办公室设主任1职。所属行业为公共管理，联系电话0454-6045230，邮政编码为154004。业务范围为水资源管理，其主要职责是：1、负责全区水资源管理、节约和保护工作。组织编制水资源专业规划并监督实施；组织、指导、监督水资源有偿使用制度的实施；指导饮用水源保护、地下水资源开发利用和管理保护工作；组织指导水资源调查、评价和监测工作，发布全区水资源公报。2、组织、指导、监督最严格的水资源管理制度的实施。实施水资源总量控制和定额管理；组织、指导、监督水量分配、计划用水和水资源调度工作。3、组织划分水功能区，组织核定江河湖库等水域纳污能力，提出限制排污总量的意见和组织实施方案；组织指导跨行政区域水量水质监督、监测。4、组织编制水利政策年度计划并监督实施；组织拟订水行政管理的规范性文件。5、负责水行政法规适用问题的答复工作和政策性文件的解释、备案、清理工作；承办水利行政复议、行政诉讼、行政赔偿；组织水法律法规及普法宣传教育工作。6、提出工程水价的建议和审核意见；负责水资源费征收；对水资源费市级留成资金安排提出意见。7、指导实施全市节约用水工作，承担区水资源管理保护委员会办公室和区节约用水办公室日常工作。8、组织指导全区水土保持工作，编制全区水土保持监测网络的规划并监督实施；指导监督全区水土流失监测、预报工作，并发布公告；指导水土流失综合防治，推广水土保持新技术；指导水生态保护和修复工作；组织或参与建设项目水土保持方案联合验收。9、负责全区水资源和水环境相关统计报表工作。10、承办局领导交办的其他事项。",
