		"地理实体概况": "    佳木斯市云环小学地址为佳木斯市友谊路406号，占地面积16588.8平方米，教学楼建筑面积7938平方米，操场面积11604平方米。现有教职工94人，在校学生1615人。为科级事业单位。所属行业为义务教育，联系电话为0454-8586531，邮政编码为154004。业务范围为小学义务教育，其主要职责是：1. 贯彻方针。全面贯彻落实国家的教育方针、政策及相关的法律法规；（授权部门：全国人大常委会；授权文号：教育法》主席令第45号第二十九条 贯彻国家的教育方针，执行国家教育教学标准，保证教育教学质量；2. 依法治校。加强学校领导班子和教职工队伍建设，不断提高队伍素质。（授权部门：全国人大常委会；授权文号：《教师法》主席令第15号第十九条各级人民政府教育行政部门、学校主管部门和学校应当制定教师培训规划，对教师进行多种形式的思想政治、业务培训。3.德育为首。面向全体学生，遵循学生身心发展规律和社会发展要求，培养学生良好的行为习惯，引导学生从小逐步树立正确的世界观、人生观和价值观。（授权部门：教育部；授权文号：《中小学德育工作规程》教基[1998]4号第五条，中小学德育工作的基本任务是，培养学生成为热爱社会主义祖国、具有社会公德、文明行为习惯、遵纪守法的公民。在这个基础上，引导他们逐步树立正确的世界观、人生观、价值观，不断提高社会主义思想觉悟，第七条中小学德育工作要注意同智育、体育、美育、劳动教育等紧密结合，要注意同家庭教育、社会教育紧密结合，积极争取有关部门的支持，促进形成良好的社区育人环境。中共中央国务院8号文件《中共中央国务院关于进一步加强和改进未成年人思想道德建设的若干意见》学校是对未成年人进行思想道德教育的主渠道，必须按照党的教育方针，把德育工作摆在素质教育的首要位置，贯穿于教育教学的各个环节。要加强心理健康教育，培养学生良好的心理品质。要把思想品德教育与法制教育紧密结合起来，使二者有机统一，相辅相成。4. 能力为重。遵循教学规律，深化课堂教学改革，减轻学生课业负担，全面提高教育教学质量，促进学生全面发展。（授权部门：全国人大常委会；授权文号：《义务教育法》主席令第52号《义务教育法）第五条依法实施义务教育的学校应当按照规定标准完成教育教学任务，保证教育教学质量。5. 安全第一。做好校园安全工作，开展师生安全教育，健全安全应急机制，定期进行安全隐患排查，确保师生在校期间的安全。（授权部门：全国人大常委会；授权文号：中华人民共和国教育部令第23号《中小学幼儿园安全管理办法》第十五条学校应当遵守有关安全工作的法律、法规和规章，建立健全校内各项安全管理制度和安全应急机制，及时消除隐患，预防发生事故。） 6. 积极配合政府动员辖区内适龄儿童入学，完成上级教育行政部门布置的其它工作任务。",
