		"地名的历史沿革": "    1951年设统计科。1973年改称统计局。2002年机构改革，根据省委、省政府批准的《佳木斯巿党政机构改革方案》（黑编〔2001〕80号），佳编〔2002〕62号文件，设置佳木斯市统计局（简称巿统计局）。根据佳编〔2010〕62号文件，于2010年12月17日整合，名称沿用至今。",
