		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市统计局地址为长安西路816号市机关中心2号楼9楼西侧。市统计局机关行政编制39名（含纪检监察单列编制2名），工勤人员编制3名。处级领导职数：局长1职，副局长3职，纪检组长1职，总统计师1职（副处级），副调研员1职。科级领导职数：科长13职（含机关党委专职副书记、监察室主任各1职），副科长5职。联系电话为0454-8222613，邮政编码为154004。主要职责是：（一） 贯彻实施国家统计法律、法规和政策、规划，起草地方性 管理办法，并组织实施；承担组织协调全市统计工作，确保统计数据真实、准确、及时的责任。（二） 组织实施国家、省统计报表制度；执行国家统计标准；指 导全巿专业统计工作和统计基层基础建设；建立健全统计数据质量审核、监控和评估制度，并组织实施。（三） 组织实施周期性的人口、经济、农业等重大国情国力普查;组织协调全巿的经济社会专项调查。（四） 对全巿国民经济、社会发展、科技进步和资源环境等情况进行统计分析、统计预测和统计监督，对全巿各县（巿）县域经济社会进行评估监测；组织实施城巿社会经济基本情况统计。向 巿委、巿政府及有关部门提供咨询建议。（五） 统一核定、管理、公布全巿性的基本统计资料，定期发布 全巿国民经济和社会发展情况的统计信息。（六）依法审批或备案各县（巿）各部门统计调查项目，组织实施全巿统计从业资格认定工作。（七）组织指导全巿统计科学研究、统计教育、统计咨询服务和统计书刊出版工作；负责全巿统计信息自动化系统和统计数据库系统；组织指导全巿统计信息化建设。（八）监督管理县及县以上政府统计部门由省提供的统计经费使用情况；协助地方党委管理县（巿）统计局局长、副局长。协助省统计局管理设在县（巿）的社会经济调查队的工作。（九）完成巿政府交办的其他事项。 ",
