		"地理实体概况": "    佳木斯市郊区莲江口卫生院地址为佳木斯市郊区莲江口镇，电业所东侧。占地面积11000平方米，新建医院综合楼2000平方米。负责莲江口、平安两乡镇居民的疾病预防、妇幼保健和新型农场合作医疗管理运营工作。卫生院开设门诊、内科、妇科、X光室、B超室、心电室等科室。有医务人员32人，其中主治医师5人，中医师7人，药剂师2人，设院长1职。所属行业为医疗卫生，联系电话为0454-8812281，邮政编码为154024。业务范围：全面贯彻预防为主方针，担负全乡的卫生行政管理和预防、保健、康复、医疗业务工作。1、制定全乡卫生事业发展概略规划和年度初级卫生保健规划，给乡政府当好参谋。2、深入开展以“除害灭害“为中心得爱国卫生运动。搞好”两管五放“加强自来水建设，改善农村环境状况和群众的居住，饮水条件的技术指导。3、加强卫生防疫工作，控制各种传染病，地方病。4、积极开展妇幼卫生工作，加强妇幼保健系统管理和计划生育技术指导工作。5、积极医治人民群众的疾病，扩大医疗服务项目。6、协助村民委做好村卫生所的巩固，发展和管理工作。7、认真做好医疗卫生信息的收集、整理、储存和反馈工作，及时准确掌握情况，定期完成各项报表任务。 ",
