		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市防洪工程建设开发处地址为长安路812号市机关中心2号楼3楼西侧，隶属于佳木斯市水务局，为科级事业单位。人员编制18人，设有主任1人，副主任1人，科长4人，科员12人。所属行业为公共管理，联系电话为0454-8437790，邮政编码为154004。业务范围为防洪工程建设管理工作，其主要职责是：1. 科学规划、设计、建设防洪工程城市防洪工程是一项复杂的系统工程，涉及到城市建设、城市交通、通信、城市排污、流域防洪等。因此，必须对防洪标准、防洪预案和工程总体布置，进行充分论证、规划。一般县（市）城镇基本不设城市防洪工程，大多数城市没有系统的防洪规划。因此，县（市）城镇在进行城市防洪工程建设前，首先必须进行科学规划、精心设计，为城市防洪工程建设提供可靠的科学依据和技术保证。2. 保证工程建设质量、规范化管理城市防洪工程建设，一定要按《防洪法》和基建程序进行，严格按国家有关规定进行规范化管理，严格按“制”（项目法人责任制、招投标制、工程监理制、合同管理制）来组织工程建设，把项目法人责任制乃至终身负责制放在突出位置，实行项目法人负责，监理单位控制，施工单位保证和政府主管部门监督的质量管理体制，确保工程建设质量。现代化的城市防洪工程建设，一定要在建设时考虑到工程建成后的管理工作，绝不要“重建轻管”。因此，在城市防洪工程建设立项后就要按建管结合的原则，尽快组建城市防洪工程管理机构，城市防洪工程管理机构在工程建设时可为项目法人代表，承担建设管理职责，工程建成后则为防洪工程管理维护单位，确保工程建成后能得到应有的管理和维护，保障工程发挥最大效益。",
