		"地名的来历": "    1988年佳木斯市城乡建设局根据佳编字[1988]106号文件，组建佳木斯市工程质量监督站。",
		"地名的含义": "    因其位于佳木斯市，主要负责全市的建设工程质量监督和检测管理工作而得名。",
		"地名的历史沿革": "    1988年成立时称佳木斯市工程质量监督站，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市工程质量监督站地址为坐落在长安西路818号，市行政中心三号楼，隶属于佳木斯市城乡建设局，为科级事业单位，核定事业编制30人，设站长一职。所属行业为公共管理，联系电话为0454-8286901，邮政编码为154004。业务范围：1、受建设行政主管部门的委托，组织安排实施地区建设工程质量监督和检测管理工作。2、认真贯彻执行国家及上级部门颁布的有关工程质量的法律、法规、政策。3、受理政府委托监督的工程建设项目报监手续，收取监督费和实施质量监督。4、向政府报送受委托的建设工程的质量监督报告。5、对建设各方的工程质量违规行为采取行政措施；对需要实施行政处罚的工程与建设各方，报告政府主管部门或接受政府主管部门委托进行行政处罚。6、对预制建筑构件和商品混凝土企业质量监督。7、不断完善检测手段，对工程质量进行检测，并监督检查检测单位和企业试验室的工作情况。8、完成上级及主管部门交办的其他工作。 ",
