		"地名的含义": "    因其位于佳木斯市境内，且主要负责佳木斯市范围内的药品、医疗器械、保健食品、化妆品和饮服务环节食品安全监督管理等各项工作而得名。",
		"地名的历史沿革": "    1953年成立时称佳木斯市卫生防疫站。2010年根据佳编〔2010〕70号文件，于2010年12月27日整合后命名为佳木斯市食品药品监督管理局，名称沿用至今。",
