		"地理实体概况": "\"    佳木斯市食品药品监督管理局地址为长安西路818号，市行政中心3号楼7楼。巿食品药品监督管理机关行政编制44名，（含纪检监察单列编制2名），工勤人员编制4名。领导职数：局长1职、副局长3职，纪检组长1职，副调研员丄职。科级领导职数：科长13职（含机关党委专职副书记1职、纪检监察室主任1职、总工程师1职），副科长9职。联系电话为0454-8635615，邮政编码为154004。主要职责是：（一） 组织实施国家和省药品、医疗器械、保健食品、化妆品和饮服务环节食品安全监督管理的法律、法规和规章；制定全巿药品、医疗器械、保健食品、化妆品和餐饮服务环节食品安全监督管理计划并监督实施。（二） 负责全市餐饮服务许可和餐饮服务环节食品安全监督管理；监督实施餐饮服务环节食品安全管理规范；开展餐饮服务环节食品安全状况调查和监测工作，发布与餐饮服务环节食品安全监管有关的信息。（三） 负责全巿保健食品、化妆品卫生许可和监督管理工作, 督实施保健食品、化妆品质量管理规范。(四）负责全巿药品、医疗器械行政监督和技术监督，监督实施药品和医疗器械研制、生产、流通、使用方面的质量管理规范。（五）负责全市药品零售经营许可和境内第一类医疗器械注册工作；负责药品和医疗器械的监督管理；监督实施国家药品、医疗器械标准；组织开展药品不良反应和医疗器械不良事件监测；配 合有关部门实施国家基本药物制度，组织实施处方药和非处方药 分类管理制度。（六）监督实施全巿中药、民族药监督管理规范和质量标准；监督实施中药材生产质量管理规范、中药饮片炮制规范；贯彻实施 中药品种保护制度；依法对野生药材资源的保护、开发和利用实施监督管理。（七）监督管理全市药品、医疗器械质量安全，发布辖区药品、 医疗器械质量安全信息；监督管理放射性药品、麻醉药品、毒性药品、精神药品。（八）组织查处全巿餐饮服务环节食品安全和药品、医疗器械、化妆品、保健食品等的研制、生产、流通、使用方面的违法、违规行为；负责保健食品、药品、医疗器械广告监督管理。（九）指导辖区内食品药品有关方面的监督管理、应急、稽查和信息化建设工作。（十）承办巿政府交办的其他事项。\"",
