		"地理实体概况": "    佳木斯市郊区长青中学地址为佳木斯市郊区长青乡，友谊路东段。校园占地面积18200平方米，建筑面积3234平方米，为四层教学楼。校内设有图书室、物理试验室、化学试验室、生物试验室、微机室、电教备课室、语音室。学校有电脑56台，安装卫星地面接收站。开设初一到初三12个教学班，有学生665人，教职员工65人。学校设书记1人，校长1人，副校长4人。所属行业为义务教育，联系电话为15145492028，邮政编码为154004。业务范围为中学义务教育，其主要职责是：坚持社会主义的学习方向，全面贯彻教育方针，面向全体学生，全面提高质量。坚持德育为首，教学为主，健康第一，努力提高人才素质，培养更多、更好的合格毕业生。贯彻落实《中共中央关于教育体质改革的决定》精神，按照两个“必须“的要求，在普通中学中引进职教因素，增强自身建设功能，充分发挥一校多功能作用，努力提高农民学生吸收应用科学技术的水平。为迅速八科学转化第一生产力服务。培养造就数以千计的社会主义的积极建设者、勇敢捍卫者、可靠接班人，是我们的根本任务。 ",
