		"地名的含义": "    因其位于佳木斯市境内，且主要负责全巿价格调控和监督管理；负责建立全市价格监测体系；监测、预测、分析全巿价格总水平变化情况等各项工作而得名。",
		"地名的历史沿革": "    1956年10月市商业局设物价科。1958年12月成立市物价管理处。1959年6月改称市场物价管理局。1973年恢复市建制，市计划委员会内设物价科。1979年重新组建市物价局。1985年合江物价局并入。于2010年12月17日，根据佳编[2010]58号文件进行职能整合并命名为佳木斯市物价监督管理局，名称沿用至今。",
