		"地理实体概况": "    佳木斯市物价监督管理局地址为长安西路818号市行政中心3号楼10楼。巿物价监督管理局机关行政编制60名（含纪检监察单列编制2名），工勤人员编制2名。处级领导职数：局长1职，副局长3职，纪检组长1职，副调研员1职。科级领导职数：科长16职含（机关党委专职副书记1职，监察室主任1职），副科长12职。联系电话为0454-8223887，邮政编码为154004。主要职责是：（一）贯彻执行国家价格工作方针政策；制定全巿价格改革中长期规划和年度工作计划；拟订全市价格宏观管理和调控措施；负责全巿价格宣传工作。（二）承担全巿价格调控和监督管理责任；负责建立全市价格 监测体系；监测、预测、分析全巿价格总水平变化情况；发布价格信息和价格公告；根据巿场价格动态，提出运用价格调节基金等经济手段、法律手段和必要的行政手段调控巿场、稳定价格的措施和建议，并负责具体组织实施。（三） 拟订地方性价格管理的政策和办法；监督指导价格法 律、法规、规章制度的贯彻实施；负责价格行政复议和行政应诉工作。（四） 按照价格管理权限，协助上级主管部门管好国家和省管理的商品价格，调整和理顺巿管商品价格，对拟调整的商品价格进 行审核、审批；规范区域内放开的商品价格行为，遏制价格突发事件；协同有关部门核定经营性收费项目和标准，参与审核行政事业性收费项目；代省发放和审验《收费许可证》，对各种乱收费进行清理。（五）组织全巿价格和收费监督检查工作；明确实施检查的法律法规依据和政策界限，依法查处价格违法行为和价格违法案件， 监督商品和服务明码标价制度的执行；监督下级政府价格主管部 门价格行政执法情况；开展价格社会监督和公共服务工作。（六） 负责组织指导全巿农产品、工业品和重要服务项目成本调查；承担对巿管商品和服务价格定价成本监审工作；负责价格评 估及全市司法机关、行政执法机关办理各种案件涉案物品的价格 鉴证工作。（七） 指导、监督下级人民政府价格主管部门的价格和收费管理理工作。（八） 依照《中华人民共和国反垄断法》，协助上级价格主管部 门认定的价格垄断行为的调查和行政执法工作。（九） 承办巿政府交办的其他事项。 ",
