		"地理实体概况": "    佳木斯市测绘管理处地址为长安西路676号，东临武警边防支队，南临长安西路，西临益海花园小区，北临大润发万新店。为副处级事业单位，隶属市城乡规划局。核定事业编制12名，设处长（副处级）1职，副处长（科级）1职，科长（副科级）3职。所属行业为公共管理，联系电话为0454-7672060，邮政编码为154004。业务范围为：（一）测绘市场管理。其中包括测绘资格的审查、审批以及年审，从事测绘工作人员作业证的考核和发放；测绘任务登记及测绘基础设施费的收取；测绘投资的招标及执行规范测绘合同文本的管理等；查处非法和不规范的测绘行为。（二）测量标志管理。包括检查、维修和查处毁坏测量标志的违法行为。（三）测绘产品质量的监督管理。该项工作主要是对测绘单位生产出来的测绘产品进行产品质量的监督检查，保证测绘产品的优良、合格，不允许不合格产品的生产和使用。（四）测绘成果管理，其中包括定期收缴测绘成果目录和副本，测绘成果的保密检查以及监督测绘成果的合法利用。（五）地图编制、出版、销售及地图制品巿场的管理，其任务包括对编制、出版的审查和报批；对地图制品（图、画、地球仪）及带有地图广告的宣传品的监督检查和对违法 行为的处罚。",
