		"地名的含义": "    安葬了抗日战争、解放战争、抗美援朝和社会主义建设的革命英烈遗骨、骨灰而得名。",
		"地名的历史沿革": "    1946年佳木斯市刚解放时，在城市的西郊，即现在的佳木斯烈士陵园所在地，安葬着抗日战争时期英勇牺牲的76位先烈遗骨和解放战争时期牺牲的225位烈士遗骨称西郊烈士陵园。1949年春，佳木斯市委、市政府在这里建立了烈士陵园。从1996年开始，佳木斯烈士陵园先后进行了三次大规模的维修改造和建设。新建排列整齐的大理石烈士墓167座，安葬了抗日战争、解放战争、抗美援朝和社会主义建设中930位革命英烈遗骨、骨灰。由黑龙江省烈士纪念事业基金会和佳木斯市人民政府共同为东北著名抗日将领夏云杰、祁致中、张传福、佳木斯市原副市长孙西林、党的好女儿邵云环、国际主义战士绿川英子、公安战线英模崔荣利、丁大成等15位烈士敬立了纪念碑（墓）。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市烈士陵园所在行政区为郊区，位于佳木斯市郊区西浦植物园南侧，东侧为社会福利大厦，南为佳木斯市电业局佳西变电所，西邻英格吐河20米，北距友谊路1千米。占地面积40000平方米。纪念塔及烈士墓为砖混结构，大理石贴面。塔、墓、碑排列有序整齐。中央修建由高15米的革命烈士纪念碑。排列整齐的大理石烈士墓167座。是我省东部地区安葬革命烈士最多、建园最早的革命烈士陵园。园内安葬有抗日战争、解放战争、抗美援朝战争和社会主义建设时期革命英烈932位，是“爱国主义”、“国防教育”、“青少年思想教育”、“革命传统教育”的基地。管理单位为佳木斯市烈士陵园管理处，为人物刘英俊及其他烈士纪念碑。",
