		"地理实体概况": "    尚坚乌黑古战场所在行政区为大来镇，位于佳木斯市大来镇山音村西北2.9千米处的白石山山顶上，此遗址北距松花江1.5千米，东距山音村2.9千米，南距大角山第二山峰1千米，西距山音古城16.5千米。该遗址地处两个丘壑山峰之间，山体呈凹字形。遗址东西长660米，南北宽500米，占地面积约330000平方米，略呈方形。遗址的表面现灌木丛生。山坡下200米处现已开辟为耕地。由于遗址地表被植被覆盖，未采集到文物标本。战斗经过：1657年，沙俄侵略军斯捷潘诺夫率军侵略松花江，清政府派兵狙剿。宁古塔昂邦章京沙尔达所部，在尚坚乌黑痛击并打败了俄国侵略军。翌年，匪首斯捷潘诺夫在战斗中葬身鱼腹。尚坚乌黑反击战有力的打击了俄国侵略者的嚣张气焰，捍卫了国家主权。管理单位为佳木斯市文物管理站，联系电话为0454-8225755，保护级别为尚未核定。",
