		"地名的含义": "    因其位于佳木斯市境内，且主要负责贯彻执行新型工业化发展战略和政策，协调解决新型工业化进程中的重大问题，拟订并组织实施工业和信息化的发展规划等各项工作而得名。",
		"地名的历史沿革": "    1949年初成立企业公司。1954年冬先后成立地方手工业局和手工业管理局。1968年地市合并，称合江革命生产部工交组。70年代后期，恢复经济委员会。2010年根据佳编〔2010〕89号文件整合，于2010年12月27日，对该局进行职能整合，并命名为佳木斯市工业和信息化委员会，名称沿用至今。",
