		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市工业和信息化委员会地址为长安西路818号，市行政中心三号楼6楼西侧，是市政府直属正处级单位。设34个内设机构，行政编制106名（含纪检监察单列编制2名），工勤人员编制15名。处级领导职数：主任1职，副主任4职，纪检书记1职，副调研员2职。科级领导职数：科长37职（含机关党委专职副书记、离退休干部工作科科长、监察室主任1职），副科长12职。联系电话为0454-8222066，邮政编码为154004。主要职责是：（一）贯彻执行新型工业化发展战略和政策，协调解决新型工业化进程中的重大问题，拟订并组织实施工业和信息化的发展规划，推进产业结构战略性调整和优化升级，推进信息化和工业化融合。（二）负责工业行业的宏观管理与综合指导；拟订行业发展战略，组织实施工业行业规划、计划，贯彻执行国家、省有关工业发展的产业政策，提出优化产业布局、结构的政策建议；贯彻落实相关政策文件，贯彻执行国家、省行业技术规范和标准，指导行业质量管理工作；协调行业内部关系和行业发展中的重大问超；承担全市重点工业项目的组织推进工作。（三）负责监测、分析工业运行态势，统计并发布相关信息，进行预测预警和信息引导，协调解决行业运行发展中的有关问题并提出政策建议；负责工业应急管理、产业安全有关工作；负责工业运行生产保障要素的综合协调和应急调节。（四）负责提出工业和信息化面定资产投资规模和方向（含利用外资和境外投资）、由国家和省负责安排的中央财政性建设资金申报意见，参与安排和管理财政专项资金；按规定权限，审查土报规划内和年度计划规模内工业和信息化固定资产投资项目。（五）贯彻执行高技术产业中涉及生物医药、新材料、信息产业等的规划、政策和标准；指导行业技术创新和技术进步，组织实施国家和省、巿有关科技重大专项，推进相关科研成果产业化；推动软件业、信息服务业（不含电信业、社会调查业、信息提供业、咨询业、经纪业）和新兴产业发展。（六）负责振兴装备制造业组织协调工作，拟订全巿重大技术装备发展和自主创新规划，协调有关重大专项的实施，推进重大技术装备国产化，指导引进重大技术装备的消化创新。 （七）拟订并组织实施工业能源节约和资源综合利用、清洁生产促进政策，参与拟订全巿能源节约和资源综合利用、清洁生产促进规划，组织协调工业环保产业发展，协调工业环境保护，组织协调相关重大示范工程和新产品、新技术、新设备、新材料的推广应用。（八）负责推进工业体制改革和管理创新，提高行业综合素质和竟争力；负责工业企业扭亏增盈工作；与有关部门共同负责企业治乱减负工作，承担巿减轻企业负担领导小组的日常工作；组织管理非国有企业内部法律顾问工作；指导企业培训和人才引进交流工作；指导相关行业加强安全生产管理。（九）负责中小企业发展的宏观指导，会同有关部门拟订促进中小企业发展和非国有经济发展的相关政策措施，协调解决有关重大问题；指导和推动全巿中小企业创业、融资、担保、创新、培训、配套服务体系建设。（十）负责统筹管理和推进全巿信息化工作，组织制定相关政策并协调信息化建设中的重大问题；促进电信、广播电枧和计算机网络融合，统筹规划和管理全巿电子政务建设，推动跨行业、跨部门的互联互通和重要信息资源的开发利用、共享。（十一）负责协调维护全巿信息安全和信息安全保障体系建设，指导监督相关部门、重点行业的重要信息系统与基础信息网络的安全保障工作，协调处理信息安全的重大事件。（十二）贯彻落实国家、省信用体系建设的政策、法规；推进社会诚信体系建设；贯彻落实社会诚信体系相关法律、法规，研究制定社会诚信体系规划和信用服务行业发展规划，并组织实施；指导和促进信用服务行业发展，管理信用服务机构；推进个人和企业信用信息的征集和使用，以及倌用信息资源的共享和信用产品的开发推广应用。（十三）负责组织开展工业、信息化的对外合作与交流；拟订和组织实施促进产品销售的政策、措施；指导企业开拓巿场；收集、整理、分析和发布国内外、省内各类经济信息；负责工业行业协会的指导。（十四）承担统一协调、指导、监督、检查全巿工业企业改制工作；负责对各行业、各种经济成分的企业实行宏观管理和指导，协调和解决企业改革发展中的重大问题，规范企业行为规则；组织落实国家、省企业改革的方针、政策，推进现代企业制度的建立；指导工业企业的管理、扭亏、脱困和减轻企业负担工作。 （十五）承办巿政府交办的其他事项。",
