		"地名的含义": "    因其位于佳木斯市郊区，主要负责郊区范围内的个体劳动的者宣传教育、服务创业、协助工作、协调关系、指导工作、对外交流、公益事业工作而得名。",
		"地名的历史沿革": "    1981年12月成立，时称佳木斯市郊区个体劳动者联合协会。1984年更名佳木斯市郊区个体劳动者协会，名称沿用至今。",
