		"地理实体概况": "    佳木斯市郊区个体劳动者协会办公室地址为友谊路8号，郊区政府办公楼后院工商局办公楼内。设主任1职，副主任1职。所属行业为公共服务，联系电话为0454-8582812，邮政编码为154004。业务范围为宣传教育、服务创业、协助工作、协调关系、指导工作、对外交流、公益事业，其主要职责是：（一）宣传教育。宣传党和国家的方针、政策，教育、引导会员在国家法律、法规允许的范围内从事生产经营活动；做好会员思想政治工作，开展形势任务教育、法制教育和职业道德教育，开展文明经营、优质服务活动；宣传协会、会员，宣传先进典型，为会员创业创造良好的社会氛围。（二）服务创业。为会员创业提供智力、信息、培训、咨询、交流等中介服务；组织会员携手帮扶，共同创业致富；积极开展调研，开展行业性服务与行业自律工作，；维护会员正当经营和合法权益；兴办为会员服务的经济实体；（三）协助工作。协助政府有关部门对个体劳动者进行行政管理，协助地方党组织、政府和有关部门搞好党、团、工会、妇女组织的建设；（四）协调关系。发挥桥梁作用，了解和反映个体经济发展情况，研究探讨个体经济在发展中的问题，反映会员的合理意见与要求，向区政府和有关部门提出发展个体经济的政策建议与督促落实有关政策；协调个体劳动者与政府有关部门、其它经济组织以及会员之间的关系；（五）指导工作。组织、指导所属会员开展自我管理、教育、服务、发展工作；（六）对外交流。开展对外经济、技术、信息等交流联络活动；（七）公益事业。支持社会福利事业，组织开展社会公益活动；（八）文化活动。关心个体劳动者的生活，开展健康有益的文化体育活动，创造会员和谐的文化家园。（九）完成区政府委托的其它工作。 ",
