		"地理实体概况": "    佳木斯市师范学校地址为长安路625号，隶属于佳木斯市职教集团，为科级事业单位，核定编制90人，设校长一职，副校长3职。所属行业为教育，联系电话为0454-8550683，邮政编码为154004。业务范围为师范教育，其主要职责是：1、负责学校普通班、函授班专业设置、专业建设和教学计划的汇总、修订、初审。2、负责学校普通班各专业教学大纲的修订、初审。3、制定和实施学校的教学文件和规章制度。4、提出学校的教学改革规划。5、负责全校各类教学班的排课、调课工作，负责安排全校各班级的晚自习辅导工作。6、负责学校日常教学运行调度。7、对各级教学管理人员进行业务指导。8、认真组织全校日常教学监督和期中教学检查工作。9、负责全校教学质量的检查评估工作。10、组织全校教学成果和教学工作的评审、推广活动。11、负责全校教学信息的收集、分配及利用。12、负责处理各种教学事故。13、负责学校各专业的教学业务管理和学籍管理工作。14、负责师生教学档案的收集、整理、归档工作。15、负责组织学校学生的教学实习、毕业论文、电子注册、申报、验印、发放毕业证等工作。16、定期下发、收阅教师日志，收集学生意见，定期向校领导汇报或向有关方面反映。17、统筹安排全校教室、实验室的使用。18、统筹安排实验教学和实验室建设工作。19、统筹管理实践教学环节。20、负责师生考勤统计工作，每月定期公布学生考勤。21、完成教学统计工作，统计、核实各种教学报酬，并上报学校。22、组织教学系（部）主任会议，组织全校性的教师业务学习和教研活动。23、制定本校师资培训计划，安排教师进修、深造。24、筹办、组织成人高考补习班。25、负责学校高师函授的教学管理、学籍管理、教学业务、毕业办证等工作。26、负责“三沟通”学历进修各专业的教学管理、学籍管理、教学业务、毕业办证等工作。27、负责与其他高校或社会团体联合办学的筹办事宜，开班后的教学管理、学籍管理、教学业务、毕业办证等工作。28、负责中学教师继续教育的教学管理、教学业务等工作。29、负责校长培训班、骨干培训班、教师资格培训班等各类短训班的办班事宜。30、负责学校、电大、“三沟通”等各系列发展规划的制定和招生、组班等工作。31、负责学校、电大、“三沟通”以及其他专业的排考、制卷、组织考试、发布作弊通告等考试、考务工作。32、负责组织英语、计算机、现代教育技术等级考试、普通话水平测试等工作。33、负责学校、电大、“三沟通”、中学教师继续教育、其他短训班的教材管理、教材供应工作。",
