		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市承办动迁安置处地址为长安西路818号市行政中心三号楼五楼，隶属于佳木斯市住房保障局，科级事业单位，事业编制十人，设中心主任一人。所属行业为公共管理，联系电话为0454-8637067，邮政编码为154004。业务范围为动迁安置工作，其主要职责是：（一）负责审查本市范围内拆迁申请人提交的材料是否齐全有效，拆迁范围、拆迁情况是否属实，拆迁计划和补偿安置方案是否符合规定要求，监管资金是否足额到位，拟委托的拆迁单位是否具有拆迁资格并核发《房屋拆迁许可证》。（二）对申领《房屋拆迁延期证》的资料进行审查、发证与备案。 （三）起草房屋拆迁公告，负责对拆迁被委托人资格的审查。（四）负责对拆迁补偿安置资金使用的监控管理。（五）负责本辖区范围内房屋拆迁宣传动员工作，对拆迁当事人进行宣传和解释房屋拆迁相关政策，切实维护拆迁当事人与被拆迁人的利益。（六）负责组织确定评估机构。（七）负责处理本辖区范围因拆迁而产生的纠纷。（八）负责本辖区范围内行政强制拆迁的有关事务。（九）负责草拟和发送征（拨）用土地拆迁安置方案及征用土地和补偿安置方案公告。（十）根据市国土资源局现有的权属地类资料，进行现场征地的调查登记。（十一）负责征（拨）地拆迁补偿登记和复核工作，对逾期不办理征（拨）地拆迁补偿登记的，进行调查、登记与确认，修改和完善征（拨）地补偿安置方案和拆迁方案。（十二）与被征地单位和被拆迁当事人签订征（拨）地补偿安置协议书和拆迁补偿安置协议书，及时支付征地拆迁补偿费用，进行征地结算。（十三）负责征（拨）地补偿安置标准和集体土地房屋拆迁有关争议的协调，负责征地拆迁争议的裁决前期工作。（十四）承办人民政府交办的其他事项。 ",
