		"地理实体概况": "    望江国家粮食储备库地址为望江镇中心西侧。库区占地面积10.5万平方米，外租用场地5.5万平方米，现有职工260人。1998年经国家计委、国家粮食储备局批准投资6008万元扩建了7500万千克仓容，并配备了现代化的储粮、发粮、烘干、粮情检测等先进设备，于2001年10月正式通过国家验收。2002年又新建一座3100平方米的拱棚仓，已投入使用。现在粮食仓容量已达9.4万吨，年经营量达到18万吨，现有固定资产在6500万元以上，平均每年收入在650万元以上，随着企业的不断发展壮大，我库已成为中型收储企业。在今后的工作中，我们要建立完善现代企业制度，把望江粮库建设成为一个现代化的国有粮食收储企业。至今先后被评为“市级文明单位标兵”，“重合同守信誉”单位，佳木斯市政府授予“先进集体”等称号。望江国家粮食储备库，属佳木斯市粮食局管辖，领导班子6人。主要业务班组有:物资股、化验股、保管股、业务股、企管股、财会股、运输队、搬运队、自动化股。所属行业为仓储业，联系电话为0454-8831511，邮政编码为154023。业务范围为粮食储存、中转、烘干和销售。",
