		"地理实体概况": "    绿云公园所在行政区为郊区，位于红旗路北段西侧，北于大型住宅小区江南雅居相邻，西侧于钢厂相邻，南侧于一条专用铁路线相邻，原来的地址是佳木斯市第六水厂改造，变成为人民休闲之所。占地面积为0.35平方千米，园区布局为四区八景，即“迎宾广场区、休闲娱乐区、森林植物景观区、水上游乐区”，八景即“园林山石、绿云雕塑、小山环椅、林中幽静、饮水思源、如意连池、拱桥亭秀、碧水蓝天。”公园建设充分运用山石、水系、植物、声音、光线和廊桥、院墙、影壁、通道组织造园空间，充分体现一种“润、幽、雅”的境界。院内现有云杉、樟子松、火炬树、梧桐、丁香、榆叶梅等乔灌木10余种1400余株。管理单位为佳木斯市园林管理处，主要景点为迎宾广场区、休闲娱乐区、森林植物景观区、水上游乐区。",
