		"地理实体概况": "    革命烈士纪念碑地址为烈士陵园内，东临儿童福利院、南临佳西供电所、西临英格吐河、北临西浦植物园。主体高度22米，占地面积20平方米，建筑结构为砖混外挂理石。碑文是：三江平原幅员辽阔，山川隽秀，地灵人杰，资源富庶，物华天宝。世纪初叶，烽烟骤起，内庭祸端，外寇凌虐，生灵涂炭，水深火热。三江儿女，义愤填膺，怒发为剑，长风为车，气贯山河，同仇敌忾。九一八事变，抗联将士，林海雪原，策马横刀，吞毡饮雪，铁岭绝岩，倭寇失魂，凶焰丧胆，千里江山，天日重见，雪耻洗辱，还我河山。解放战场，弹雨枪林，南征北战，终赢光华。五星红旗，插遍华夏，抗美援朝，卫国保家。三江儿女，昂然进发，英雄战歌，唱响天涯。革命建设，兴我中华。百业带举，建设国家。政革开放，变化巨大，追溯历程，风风雨雨，英雄伟业，可歌可泣。革命先烈，浩气长存，时值中华人民共和国建国五十周年暨佳木斯市革命烈士陵园建园五十周年之际，为继往开来，昭示后人，特立此碑以志纪念。",
