		"地理实体概况": "    黑龙江锻压机床厂地址为佳木斯市郊区友谊路258号，公司有50余年生产锻压机床的经验和形成的集产品开发、设计、制造、售后服务为一体的经营管理体系，造就了“黑龙”品牌在国内锻压机床市场的知名品牌，在市场上享有很高的声誉。是国内锻压行业首家通过ISO9001-2000及机械安全认证的企业，是集设计、科研、制造、服务于一体的、东北地区最具规模的锻压机械制造企业；是黑龙江省省高新技术企业，国务院批准的出口基地企业。企业占地面积18万平方米，员工800多人，工程技术120人员多人。拥有齿轮磨床、导轨磨床、球头磨床、螺纹磨床、数控镗铣床、控车床及数控加工中心等一大批先进的加工设备，拥有强大的技术队伍及不断完善的管理体系，主要生产YD28、828、Y34、YA34、Y30、YP系列油压机，JH21、JH25、JH31、04、SSP、J76、STP、STPL、J21、J21DP等系列压力机，KJS数控开卷校平送料装置及各种自动冲压生产线。产品畅销全国并远销欧美及东南亚各国，深受广大客户的欢迎。所属行业为制造业。联系电话为0454-8587904，邮政编码为154004。",
