		"地名的历史沿革": "    佳木斯葡萄酒厂始建于1972年。1995年葡萄酒厂被剥离经营，完全由个人承租，吴琦、汪忠山承租了该厂。1996年至1997年葡萄酒厂处于停产阶段。1997年12月葡萄酒厂被四丰山园艺畜牧场顶农业银行欠款一千零几万元。从此葡萄酒厂从四丰山园艺畜牧场板图中剥离出去。2000年时原葡萄酒厂已经由个人买断并更名为吉祥酒业，名称沿用至今。",
