		"地理实体概况": "    佳木斯市吉祥酒业地址为四丰乡四丰山水库西侧。佳木斯葡萄酒厂始建于1972年，东临四丰山水库，南临花园村，西临四丰山，北临四丰山水库。是省内唯一一家颇具规模的以葡萄酒生产为主的综合性酒厂。总占地4万平方米，有职工86人，工程技术人员7人，固定资产960万元，主要生产白葡萄酒、全汁葡萄酒、枣酒、黑加仑酒等。产品销往全国二十多个省、市和地区，有三个品种连年获省优质产品。年产量1000余吨，产值300万元，利税近50万元。果酒是四丰山园艺场的拳头产品，品种有24个，同年又新开发白羽、金运来等4个新品种，到1991年元旦，春节果酒供不应求。从1985年起该厂的白葡萄酒、人参都柿酒连续获得黑龙江省优质产品称号。1993年在原有24个品种情况下，又新研制了“菊花白”系列低度白酒。1994年四丰山园艺畜牧场根据省下发的《国有企业产权制度改革若干办法》对下属各单位进行了全方位的经营机制转换工作。葡萄酒场当时是集体承包单位，产品有：果酒、白酒、补酒三个系列。1995年经营产品主要是果酒，在原有产品上又新增加一个“金丝枣”果酒产品，曾改变了葡萄酒厂产品滞销的局面。现在，原葡萄酒厂已经由个人买断并更名为吉祥酒业，该厂生产规模不但没有缩小，反而增加生产线。目前，经营状况良好，产品在全国各地比较畅销。所属行业为白酒制造。联系电话为0454-8885888，邮政编码为154015。",
