		"地名的历史沿革": "    1955年8月成立中国人民政治协商会议佳木斯市委员会。文化大革命期间政协机构瘫痪。1980年10月恢复政协机构。1996年根据佳编[1996]133号文件整合而成立。2003年机构改革，根据《黑龙江省机构编制委员会关于印发佳木斯巿人大政协机关机构改革方案的通知》（黑编〔2003〕39号）精神，佳编〔2003〕47号文件，《中国人民政治协商会议黑龙江省佳木斯市委员会机关机构改革方案》经巿委批准，整合后并命名为中国人民政治协商会议黑龙江省佳木斯市委员会机关，名称沿用至今。",
