		"地名的历史沿革": "    根据《黑龙江省人民政府办公厅关于印发黑龙江省规范基层医疗卫生体质综合改革工作程序指导意见的通知》（黑政办发[2011]8号）文件的要求。佳编办[2011]30号文件，2011年5月11日成立长青办社区卫生服务中心，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "\"    佳木斯市郊区佳西办社区卫生服务中心地址为友谊路820号，东临友谊小学，南临友谊路，西临起点家园小区，北临赛瑞糖业，设中心主任一职，编制5人。所属行业为医疗卫生，联系电话为0454-8593939，邮政编码为154004。业务范围为社区预防、社区保建、社区医疗、社区康复、社区建康教育、社区计划生育，主要职责：1、社区预防：卫生诊断传染病疫情报告和监测，预防接种，结核病、艾滋病等重大传染病预防，常见传染病防治，地方病，寄生虫病防治，健康档案管理，爱国卫生指导等。 2、社区保建：妇女保建，儿童保建，老年保建等。3、社区医疗：一般常见病、多发病的治疗。现场救护，慢性病筛查和重点慢性病病例管理，精神病患者管理，转诊服务，家庭出诊, 家庭护理，家庭病床，临终关怀等。4、社区康复：残疾康复，疾病恢复期康复，家庭和社区康复训练指导等。5、社区建康教育：卫生知识普及，个体和群体的建康管理，重点人群与重点场所健康教育，宣传建康行为和生活方式等。6、社区计划生育：计划生育技术服务与咨询指导，发放避孕药具等。7、协助处理服务区内的突发公共卫生事件。8、承担卫生行政部门要求履行的卫生监督协管等其他职能。\"",
