		"地名的含义": "    因位于佳木斯市郊区，主要负责征集、整理、编纂区委重要党史资料等各项工作。",
		"地名的历史沿革": "    1983年12月区委成立来党史资料征集办公室。1986年12月改称区委党史工作办公室。佳郊编字〔1990〕56号文件收悉，根据市委常委地7届103次会议纪要，佳编办字〔1991〕35号文件，1991年4月13日同意成立佳木斯市郊区党史研究室。2000年变为参公事业单位，2002年并入组织部，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
		"测量方法": "实地测量",
		"地理实体概况": "    佳木斯市郊区委党史研究室地址为佳木斯市郊区友谊路8号，为区委工作部门。又是区委科研机构。研究室为区委组织部的直属事业单位，有事业编制2名。所属行业为事业单位，联系电话为0454-8574476，邮政编码为154002。业务范围：1、贯彻落实中央和省、市有关党史工作的方针、政策，制定全区党史工作规划并组织实施； 2、征集、整理、编纂区委重要党史资料，收集整理重要口述历史资料、重要党史人物回忆录，搜集、整理和研究有关中共党史、中共地方党史的信息资料。对征集到的各种资料认真考证、核实、整理，分类编目立卷，实行科学管理； 3、研究、编撰地方党史专著，编辑出版重要党史书刊； 4、对党的地方历史和区委党史重要人物等进行综合研究，总结历史经验，为党的建设和区委决策提供历史借鉴； 5、发挥 “资政育人”职能，用党史研究成果开展爱国主义和革命传统宣传教育活动，围绕区委中心工作，进行专题调查研究，为区经济社会的更快发展服务； 6、 负责审核拟公开发表或出版的本区以地方党史为主要内容的重要文章、书报、刊物及影视作品，审查区涉及党史、革命史及革命英烈的展览、纪念馆等； 7、加强自身建设，按照“有诚实守信的做人原则，有资政育人的责任意识，有严谨求实的治学态度，有扎实刻苦的工作作风，有淡泊名利的思想境界，有团结协作的大局意识”要求，努力建设一支觉悟高、作风正、能力强的党史工作队伍。 8、完成区委和上级党史部门交办的各项工作。",
