		"地理实体概况": "\"    佳木斯市供销合作社联合社地址为长安西路812号市机关中心2号楼3楼，市供销联社7个职能科（部、室）。市供销联社事业编制26名（含工勤人员编制1名）。主任兼党委书记1名，副主任3名，党委副书记1名，纪检书记1名，工会主席1名，科长7名，副科长2名。所属行业为公共管理，联系电话为0454-8319609，邮政编码为154004。业务范围为对全市供销合作社的农副产品、农业生产资料等经营、贸易进行组织、协调和管理，开拓农村市场，促进城乡一体化和农业产业化进程，引导农民有组织地进入市场，主要职责：（一）制定全市供销合作社的发展战略和发展规划，指导全市供销社的改革和发展，建立和完善为农业社会化服务的体系，强化为农服务功能。（二）宣传党和政府关于农村经济的方针、政策；向市委、巿政府和有关部门反映农民的合理要求，协调与政府有关部门及其它社会组织的关系，提出有关发展合作社事业的政策建议,维护各级供销合作社的合法权益。（三）对全市供销合作社的农副产品、农业生产资料等经营、贸易进行组织、协调和管理，开拓农村市场，促进城乡一体化和农业产业化进程，引导农民有组织地进入市场。（四）负责对所属企业主要负责人的聘任和解聘，监督企业的经营管理；负责全市供销合作社资产的保值增值。 （五）发展农产品加工、储藏、运输业和其它二、三产业，发展各种类型的专业合作社和村级综合服务站，积极为农业、农村、农民提供综合性、系列化的经济技术服务。 （六）帮助农村和农户培植优质、特色农产品和绿色农产品生产基地。（七）统领和发展农村各类中介组织和农民经纪人队伍以及农村中的各种经济行业协会。（八）负责供销合作社系统的组织和队伍建设，贯彻民主办社原则，加强系统的组织联合与合作。（九）承办市委、市政府交办的其他事项。\"",
