		"地名的含义": "    因其位于佳木斯市郊区，负责带领郊区境内全体民盟盟员认真履行政治协商、民主监督，参政议政的职能工作而得名。",
		"地名的历史沿革": "    1941年在重庆成立，当时的名称是中国民主政团同盟。1944年改名为中国民主同盟。1956年在佳木斯市成立民盟组织。1983年称民盟佳木斯市郊区直属支部。1996年改称中国民主同盟佳木斯市郊区委员会，名称沿用至今。",
