		"地名的来历": "    由佳木斯市人民政府于1959年根据佳人字第335号文件批准成立，命名为佳木斯市郊区文化馆。",
		"地名的含义": "    因其位于佳木斯市郊区，主要负责促进郊区境内的文化传播、交流的工作而得名。",
		"地名的历史沿革": "    成立于1959年9月9日。佳人字第335号文件，黑龙江省佳木斯市人民政府人民委员会关于建立区文化馆的决定。1973年9月15日，佳发[1973]23号文件，区革委会设文教科，文化馆隶属文教科。1984年4月18日，根据佳编字[1979]146号文件，文化馆隶属文化科。1985年3月2日，根据佳编字[1985]154号文件，文化馆隶属文化局，名称沿用至今。",
		"密级": "秘密",
		"坐标系": "2000国家大地坐标系",
