		"地理实体概况": "    佳木斯市郊区文化馆地址为佳木斯市郊区友谊路16号，郊区政府东厢楼4楼，东临农业银行，南临友谊路，西临佳木斯市交通运输管理站，北临广源物流管理中心。郊区政府办公楼东楼一层。人员编制5人，设馆长1人。所属行业为事业单位，联系电话为13359649883，邮政编码为154004。业务范围为文化交流、传播，宣传党的方针、政策的窗口。是活跃人民群众文化生活，提高人民群众素质的阵地。并是农村文化三级网的龙头，主要有三项任务：1、通过各种文化活动，提高人民群众的精神境界和社会主义觉悟。培养共产主义的理想、信念、道德和情操。培养科学态度和实干作风。发扬积极进取和用于改革的精神，激励人民热爱祖国，为建设社会主义现身奋斗，造就社会主义一代新人。2、使人民群众在劳动工作之余能够得到有益身心的文化娱乐，以利于消除疲劳、恢复体力、陶冶情操、焕发精神。3、积极创造条件，使人民群众在业余时间有可能自愿地参加各种文化娱乐活动。从体力和智力两个方面发展自己的个性和创造才能，增进自己的知识、技能、智慧和健康。",
