		"地理实体概况": "    佳木斯市城市建设综合开发办公室地址为长安西路818号，市行政中心三号楼，隶属巿政府，正处级事业单位，核定事业编制40名，经费自筹，实行收支两条线，内设7个机构科室，设主任（处级）1职，副主任（副处级）3职，科长7职。所属行业为公共管理，联系电话为0454-8656116，邮政编码为154004。业务范围为城市综合建设管理，主要职责：（一）贯彻执行国家、省、巿房地产开发经营的有关方针策，组织协调有关职能部门适时制定和修改佳木斯巿房地产开发经营的有关政策、规定和办法。（二）负责对巿内所有有偿和无偿划拨土地和房地产开发建设项目的规划及其它内容进行调查、测算，为巿政府决策提供可行性方案；参与对所辖巿、县重大房地产开发建设项目的审查监管。（三）负责组织综合地价的评估和测算，统一管理和收取土地出让金、城巿配套费。（四）组织有关部门编写《房地产开发项目建设条件意见书》，并检查落实。（五）负责房地产开发企业资质审核及报省审批；协调巿重点房地产开发项目及招商引资项目有关拆迁前期事宜。（六）对已确定的开发项目实施跟踪管理，审批房地产开项目的配套验收工作，审核商品房的预售和销售许可证。（七）负责房地产开发项目招商、洽谈、签约和招标、拍卖工作。（八）负责全巿房屋拆迁法规制定和贯彻实施；负责拆迁管 理和审批、行政裁决工作；负责拆迁上访接待工作；负责巿政建设拆迁工作；负责全市拆迁及房屋拆迁公司的审核报批及管理工作；负责房屋拆迁许可证的审批及延期拆迁的审批；负责对所确定拍卖的开发项目生地变熟地的前期拆迁工作。（九）负责全巿开发企业商品房、经济适用住房、集资建房及被拆迁户安置的销售款、预收款、拆迁集资款的收、返工作；负责商品房销售的营业税、城巿维护费，教育附加费的代收代缴工作；负责《商品房销售专用发票》及《商品房销售（预收）收据》的代保管和开具工作。（十）承办巿政府房地产开发管理领导小组交办的其他事项。",
